INSERT INTO `tbl_yginfo` VALUES ('1', '重点产品质量监督工作暂行规定', '<DIV align=center>第一章&nbsp; 总&nbsp; 则</DIV>\r\n<DIV>第一条&nbsp; 为加强宁波市质监系统产品质量监督工作，确保产品质量安全，依据《产品质量法》等法律法规的规定，制订本规定。</DIV>\r\n<DIV>第二条&nbsp; 按照“政府负总责，职能部门负监管责任，企业负主体责任”的原则，市、县两级质监部门是本辖区生产领域产品质量监督工作的主管部门，并负责依法做好辖区内除法律法规明确授权其他行政机关实施行政许可或主管的产品外的所有地产产品的质量监督工作。</DIV>\r\n<DIV>第三条&nbsp; 重点产品质量监督工作主要手段为产品质量“五预”、“五查”，其中“五预”是指预告、预析、预测、预警、预治，“五查”是指日常巡查、专项检查、质量抽查、现场核查、工作督查。</DIV>\r\n<DIV>第四条&nbsp; 本规定所指的重点产品是市、县两级质监部门正式发文确定的辖区范围内列入重点监管的产品（不包括食品）。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第二章&nbsp; 职责分工</DIV>\r\n<DIV>第五条&nbsp; 巡查人员职责任务：</DIV>\r\n<DIV>（一）根据上级部门要求，认真落实产品质量‘预告’工作；</DIV>\r\n<DIV>（二）严格按照《宁波市质监系统重点产品生产企业日常巡查工作规范》（见附件）规定内容开展日常巡查;</DIV>\r\n<DIV>（三）严格按照《宁波市质监系统日常巡查发现问题处置规定》处理巡查中发现的问题;</DIV>\r\n<DIV>（四）对巡查中发现的产品质量违法行为，依法予以查处；</DIV>\r\n<DIV>（五）填写《日常巡查记录表》，详细记录巡查的内容、发现的问题、采取的措施等情况，经企业签字盖章确认后，及时存档备查。</DIV>\r\n<DIV>第六条&nbsp; 县（市）、区质量技术监督局（分局）职责任务：</DIV>\r\n<DIV>（一）统一贯彻落实上级质监部门和当地政府关于产品质量安全监督工作的部署和要求，依法履行辖区内生产领域产品质量监督责任；</DIV>\r\n<DIV>（二）每年初向当地政府提交产品质量监管工作专题报告，总结汇报上年度工作，提出本年度工作重点。并根据工作实际及时报告在履行监督职能中需要政府协调解决的以下问题：</DIV>\r\n<DIV>1、需要政府牵头组织整治的区域性、行业性产品质量问题；</DIV>\r\n<DIV>2、需要政府牵头处置的涉及产品质量的重大突发事件；</DIV>\r\n<DIV>3、根据产品质量监管工作需要，应配备的人、财、物等能力保障；</DIV>\r\n<DIV>4、将产品质量区域监管工作纳入对各级政府考核体系中。</DIV>\r\n<DIV>（三）根据全市产品质量监督工作要点，确定本辖区重点监管和重点关注产品目录，并负责涉业企业质量信息调查、分析等基础工作；</DIV>\r\n<DIV>（四）负责落实产品质量“预告”工作，及时向辖区内生产企业通报新出台的法规、标准等监管信息，及时向上级局和当地政府报送潜在的行业性、区域性产品质量问题隐患；</DIV>\r\n<DIV>（五）配合市局开展产品质量“预析”、“预测”工作，负责搜集整理产品质量监管工作信息，定期对本辖区地产产品质量进行预分析，并根据预析结果，做好辖区内产品质量预检测工作；</DIV>\r\n<DIV>（六）组织落实产品质量“预治”，对辖区内列入质量预警产品，及时开展预整治，其中警情严重的，上报当地政府，在当地政府的统一领导下开展整治，并根据上级局部署，做好辖区内重点产品专项整治和区域性、行业性产品质量问题整治工作；</DIV>\r\n<DIV>（七）组织开展辖区内重点监管产品的“日常巡查”，明确日常巡查工作内部职责分工，建立健全相关制度规定，确保对本辖区重点监管产品日常巡查工作达到规定要求。负责对所属科、队、所（站）日常巡查工作的检查督查；</DIV>\r\n<DIV>（八）组织开展辖区内重点产品的“监督抽查”和日常执法检查工作，配合市局开展重点产品“专项检查”和重点获证产品生产企业的“现场核查”，及时掌握当地企业获证情况；</DIV>\r\n<DIV>（九）根据当地政府、上级局的总体部署，组织处置本辖区内发生的涉及质监监管职能的质量安全突发事件；</DIV>\r\n<DIV>（十）及时向发证机构、检验机构通报日常监管中发现的涉及行政许可、认证认可、监督抽查工作质量等相关问题。</DIV>\r\n<DIV>第七条&nbsp; 宁波市质量技术监督局职责任务：</DIV>\r\n<DIV>（一）依据产品质量法等法律法规的授权和市政府的统一部署，抓好全市地产产品质量监督工作，确保全市质监系统依法履行对生产领域的产品质量监督责任；</DIV>\r\n<DIV>（二）每年初向市政府提交产品质量监管工作专题报告，总结汇报上年度工作，提出本年度工作重点。并根据工作实际及时报告在履行监督职能中需要政府协调解决的以下问题：</DIV>\r\n<DIV>1、需要政府牵头组织整治的区域性、行业性产品质量问题；</DIV>\r\n<DIV>2、需要政府牵头处置的涉及产品质量的重大突发事件；</DIV>\r\n<DIV>3、根据产品质量监管工作需要，应配备的人、财、物等能力保障；</DIV>\r\n<DIV>4、将产品质量区域监管工作纳入对各级政府考核体系中。</DIV>\r\n<DIV>（三）制订实施年度全市产品质量监督工作要点，确定全市重点监管产品目录和工作重点，建立适应产品质量监督工作需要的产品质量基本信息库；</DIV>\r\n<DIV>（四）健全完善全市质监系统产品质量监督工作制度，制订相关工作规范和考评办法；</DIV>\r\n<DIV>（五）建立产品质量安全信息通报制度，及时向各级政府、相关职能部门和社会公众发布产品质量信息；</DIV>\r\n<DIV>（六）组织开展全市产品质量“预析”、“预测”、“预警”和重点监管产品的“质量抽查”、“现场核查”、“工作督查”、“专项检查”等相关工作；</DIV>\r\n<DIV>（七）制订全市质监系统处置产品质量突发事件应急预案，并组织演练，在市政府统一领导下，组织处置涉及质监监管职能的产品质量安全突发事件；</DIV>\r\n<DIV>（八）组织开展总局、省局确定的重点产品专项整治和涉及全市范围的区域性、行业性产品质量问题的专项整治，确保如期完成整治任务；</DIV>\r\n<DIV>（九）根据产品质量监督抽查、风险监测和预分析结果，向省局和市政府报送区域性、行业性产品质量问题隐患；</DIV>\r\n<DIV>（十）对重点监管产品和重点整治产品组织开展全市性专项执法行动。</DIV>\r\n<DIV>第八条&nbsp; 市局稽查支队职责任务：</DIV>\r\n<DIV>（一）根据市局部署配合职能处开展专项执法检查，对市局确定的重点监管产品和重点关注产品以及列入专项整治产品组织开展执法检查；</DIV>\r\n<DIV>（二）承担市局交办的监督抽查不合格企业后处理任务；</DIV>\r\n<DIV>（三）提供涉及产品质量安全的执法办案信息，及时上报工作中发现的行业性、区域性产品质量问题或具有潜规则的行业性质量安全隐患，协助职能处开展行业潜规则的调查分析。</DIV>\r\n<DIV>第九条&nbsp; 法定检验机构职责任务：</DIV>\r\n<DIV>（一）承担各级质监部门下达或委托的监督检验任务，及时报送检验结果，按要求提供产品质量分析报告，并对具备检验检测能力的产品，开展产品质量预分析；</DIV>\r\n<DIV>（二）提供质量安全检验检测信息，完成质监部门下达的重点产品质量安全风险监测任务，及时向市、县级局上报工作中发现的产品质量违法行为，行业性、区域性产品质量问题或具有潜规则的行业性质量安全隐患；</DIV>\r\n<DIV>（三）协助行政机关和专职执法机构实施监督检查和行政执法检查。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第三章&nbsp; 责任追究</DIV>\r\n<DIV>第十条&nbsp; 巡查人员未按本规定要求履职且出现下列情形之一的，分别给予批评教育、考核奖惩挂钩、组织处理等形式的责任追究：</DIV>\r\n<DIV>（一）未按要求履行产品质量日常巡查职责的；</DIV>\r\n<DIV>（二）发现重大质量问题或行业性、区域性产品质量隐患后未及时上报，导致被媒体曝光或上级部门通报的；</DIV>\r\n<DIV>（三）发现产品质量违法行为，不制止，不查处的。</DIV>\r\n<DIV>第十一条&nbsp; 县（市）、区质量技术监督局（分局）未按本规定要求履职且出现下列情形之一的，视情取消该单位年度考核中评优或相应的单项奖评选资格，并分别给予相关人员批评教育、考核奖惩挂钩、组织处理等形式的责任追究：</DIV>\r\n<DIV>（一）对上级质监部门和当地政府关于产品质量监督工作的要求，不贯彻执行，不安排落实，造成监管缺失的；</DIV>\r\n<DIV>（二）辖区内发生负有直接监管责任的产品质量安全事件的；</DIV>\r\n<DIV>（三）辖区内发生被国家总局点名的区域性质量问题或产品质量红色警告、黄色警示、警情通报多于市局规定的；</DIV>\r\n<DIV>（四）对区域性产品质量问题整治或重点产品专项整治不力，导致未在规定时间内通过整治验收的；</DIV>\r\n<DIV>（五）处置质量安全突发事件不及时，该报告的不报告或拖延报告，导致事态扩大或造成严重后果的；</DIV>\r\n<DIV>（六）未建立健全产品质量监管工作制度规定，造成责任不清、推诿扯皮的；</DIV>\r\n<DIV>（七）对一线巡查、监管、执法人员的履职情况不开展监督检查，导致重点产品质量监管工作秩序混乱的。</DIV>\r\n<DIV>第十二条&nbsp; 市局稽查支队未按本规定要求履职且出现下列情形之一的，视情取消该单位年度考核中评优资格，并分别给予相关人员批评教育、考核奖惩挂钩、组织处理等形式的责任追究：</DIV>\r\n<DIV>（一）发现产品质量违法行为没有及时组织查处的；</DIV>\r\n<DIV>（二）承办市局交办的工作任务时，出现推诿扯皮现象的；</DIV>\r\n<DIV>（三）未及时上报工作中发现的涉及产品质量安全和区域性、行业性质量问题，造成事态扩大的。</DIV>\r\n<DIV>第十三条&nbsp; 法定检验机构未按本规定要求履职且出现下列情形之一的，视情取消该单位年度考核中评优或相应的单项奖评选资格，并分别给予相关人员批评教育、考核奖惩挂钩、组织处理等形式的责任追究：</DIV>\r\n<DIV>（一）出现严重工作质量问题，受到省局、市局通报批评的；</DIV>\r\n<DIV>（二）因检验结果发生错误，导致行政诉讼败诉的；</DIV>\r\n<DIV>（三）承办市、县级局交办的工作任务时，出现推诿扯皮现象的，未及时上报工作中发现的产品质量违法行为、涉及产品质量安全和行业性、区域性产品质量问题的，不及时提供产品质量监督抽查信息和质量分析报告的；</DIV>\r\n<DIV>（四）违反监督抽查相关规定，情节严重影响后处理工作进行的。</DIV>', 'xc_jd_new', null, null, '2010-03-01 15:14:55', '1', 'admin');
INSERT INTO `tbl_yginfo` VALUES ('2', '重点产品生产企业日常巡查工作规范', '<DIV align=center>第一章&nbsp; 总&nbsp; 则</DIV>\r\n<DIV>第一条&nbsp; 为加强全市质监系统产品质量监督工作，健全日常巡查工作制度，规范监督行为，主动发现产品质量问题，进一步督促企业落实质量安全主体责任，确保辖区内产品质量安全，根据《关于进一步加强安全类产品质量监督工作意见》、《宁波市质监系统重点产品质量监督工作暂行规定》（以下简称《暂行规定》）的要求，制定本规范。</DIV>\r\n<DIV>第二条&nbsp; 日常巡查依据为《产品质量法》、《认证认可条例》、《工业产品生产许可证管理条例》、《棉花质量监督管理条例》等法律法规。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第二章&nbsp; 组织领导</DIV>\r\n<DIV>&nbsp;第三条&nbsp; 市质量技术监督局监督稽查处负责全市重点监管产品日常巡查工作的综合管理和监督检查。</DIV>\r\n<DIV>第四条&nbsp; 各县（市）、区质量技术监督局（分局）负责组织对本辖区内市、县两级列入重点监管的产品开展日常巡查工作。</DIV>\r\n<DIV>第五条&nbsp; 各县（市）、区质量技术监督局（分局）要根据市局的工作部署和日常巡查工作要求，整合科、队、站（所）的力量，明确具体的职责分工和工作机制，建立检查考评制度。</DIV>\r\n<DIV>第六条&nbsp; 相关市级检验机构应积极为全市重点监管产品日常巡查工作提供技术支撑。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第三章&nbsp; 计划制订</DIV>\r\n<DIV>第七条&nbsp; 各县（市）、区质量技术监督局（分局）根据上级下达的巡查任务和辖区内重点监管和重点关注产品质量状况，分别制订年度和季度巡查计划。</DIV>\r\n<DIV>第八条&nbsp; 市局确定的年度重点监管产品的生产企业和列入市级以上预警产品的生产企业为日常巡查的必查企业，应视情增加巡查频次。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第四章&nbsp; 日常巡查要求</DIV>\r\n<DIV>第九条&nbsp; 主动宣传产品质量法律法规及相关规定要求，督促企业认真履行产品质量主体责任，依法履行下列义务：</DIV>\r\n<DIV>（一）按标准组织生产。生产、加工的产品按相应的国家标准、行业标准、地方标准或企业标准组织生产和实施出厂检验；</DIV>\r\n<DIV>（二）生产、加工实施行政许可或强制认证的产品，依法取得相应行政许可或认证证书，并确保持续保持许可、认证要求；</DIV>\r\n<DIV>（三）健全落实企业内部的质量管理制度，完善质量保证体系，确保产品质量稳定合格；</DIV>\r\n<DIV>（四）出厂产品经检验合格并符合法定要求；</DIV>\r\n<DIV>（五）确保产品或其包装上的标识真实且符合相关法律法规要求；</DIV>\r\n<DIV>（六）依法承担对产品质量的其他法定责任和义务。</DIV>\r\n<DIV>第十条&nbsp; 根据上级部门质量风险分析处置要求，认真落实产品质量“预告”工作，主动向企业宣贯产品标准更新、行政许可、质量整治等相关信息和要求。</DIV>\r\n<DIV>第十一条&nbsp; 日常巡查重点检查以下内容：</DIV>\r\n<DIV>（一）检查企业获证情况。是否存在未取得生产许可证，擅自生产列入工业产品生产许可证目录产品的违法行为；是否存在未经认证，擅自出厂、销售列入强制性认证目录产品的违法行为；是否存在企业名称发生变化未依照规定办理生产许可证变更手续的违法行为。</DIV>\r\n<DIV>（二）检查企业原材料质量把关情况。是否存在生产、加工中使用未取得生产许可证或者未经强制性认证的原辅材料（产品）的违法行为。</DIV>\r\n<DIV>（三）检查标识标注情况。是否存在伪造产品产地，伪造或者冒用他人厂名、厂址，伪造或者冒用认证标志等质量标志的违法行为；是否存在未依照规定在产品、包装或者说明书上标注生产许可证标志和编号等违法行为；是否存在未经强制认证但在其产品包装上使用虚假文字表明其通过认证等伪造、冒用认证证书的违法行为；是否存在伪造、变造许可证证书、生产许可证标志和编号的违法行为。</DIV>\r\n<DIV>（四）检查委托与被委托生产情况。生产许可证产品委托企业是否存在未按规定备案或者擅自改变备案标注方式的违法行为；生产许可证产品被委托企业是否存在未按规定备案的违法行为。</DIV>\r\n<DIV>（五）检查企业执行标准情况。是否存在未按规定制定标准作为组织生产依据或者未按规定要求将产品企业标准上报备案的违法行为；是否存在执行已经公告废止的国家、行业、地方标准的违法行为；</DIV>\r\n<DIV>第十二条&nbsp; 巡查人员在巡查中发现问题符合下列情形之一的，应责令企业限期改正：</DIV>\r\n<DIV>（一）取得生产许可证的企业名称发生变化，未依照规定办理变更手续的；</DIV>\r\n<DIV>（二）产品获得强制性认证但未按规定使用认证标志，或者企业取得生产许可证但未依照规定在产品、包装或者说明书上标注生产许可证标志和编号的；</DIV>\r\n<DIV>（三）未按规定制定标准作为组织生产依据或者未按规定要求将产品企业标准上报备案的；</DIV>\r\n<DIV>（四）其他法律法规规定应予责令改正的情形。</DIV>\r\n<DIV>第十三条&nbsp; 巡查人员在巡查中发现问题符合下列情形之一的，应依法转立案查处：</DIV>\r\n<DIV>（一）未取得生产许可证而擅自生产列入目录产品的，或者未经强制性认证，擅自出厂、销售列入目录产品的；</DIV>\r\n<DIV>（二）生产、加工中使用列入目录但未取得生产许可证或者未经强制性认证的原材料（产品）的；</DIV>\r\n<DIV>（三）伪造产品产地的，伪造或者冒用他人厂名、厂址的，伪造或者冒用认证标志等质量标志的；</DIV>\r\n<DIV>（四）伪造、冒用认证证书的，或者伪造、变造许可证证书、生产许可证标志和编号的；</DIV>\r\n<DIV>（五）委托企业未按规定备案或者擅自改变备案标注方式的，或者被委托企业未按规定备案的；</DIV>\r\n<DIV>（六）其他法律法规规定应予立案查处的情形。</DIV>\r\n<DIV>第十四条&nbsp; 巡查人员遇到符合下列情形之一的，可以对相关产品进行抽样检验：</DIV>\r\n<DIV>（一）生产、加工中使用未取得生产许可证或者未经强制性认证的原辅材料（产品）的；</DIV>\r\n<DIV>（二）执行已经公告废止的国家、行业、地方标准的；</DIV>\r\n<DIV>（三）出厂检验不符合执行标准规定的项目、方法和要求的。</DIV>\r\n<DIV>第十五条&nbsp; 巡查人员应使用“宁波市质量技术监督局应用平台”，认真填写《日常巡查记录表》，记录巡查的内容，发现的问题，采取的措施等情况，并经企业签字确认后，存档备查。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第五章&nbsp; 结果分析</DIV>\r\n<DIV>第十六条&nbsp; 日常巡查结束后，要对巡查企业存在的主要问题进行综合分析，形成分析报告，并按《宁波市质监系统质量安全风险信息收集、分析与处置工作制度》要求，每季度第一个月5日前将上一季度分析报告上报市局监督稽查处。</DIV>\r\n<DIV>第十七条&nbsp; 日常巡查中，发现的行业性、区域性产品质量问题或具有潜规则的行业性质量安全隐患要及时上报市局。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第六章&nbsp; 后续监管</DIV>\r\n<DIV>第十八条&nbsp; 各县（市）、区质量技术监督局（分局）要及时汇总分析日常巡查情况，针对发现的问题，落实具体的责任人，落实后续监管措施，督促企业限期整改。</DIV>第十九条&nbsp; 对日常巡查中发现的行业性、区域性产品质量问题或具有潜规则的行业性质量安全隐患由市、县两级局视情开展产品质量专项监督抽查和专项执法检查。', 'xc_jd_new', null, null, '2010-03-01 15:18:53', '1', 'admin');
INSERT INTO `tbl_yginfo` VALUES ('3', '日常巡查人员行为规范', '<DIV>日常巡查人员代表着质监队伍的形象，是企业和群众了解质监部门的“窗口”。为进一步加强巡查人员的行风建设，现将行为规范明确如下：</DIV>\r\n<DIV>一、应当着装整齐，主动出示证件，不得隐瞒身份。</DIV>\r\n<DIV>二、应当文明礼貌，不得饮酒和发生不文明行为。</DIV>\r\n<DIV>三、应当尽心尽职，不得擅离岗位，贻误工作。</DIV>\r\n<DIV>四、应当严格履职，不得提出与巡查无关的要求和从事其他活动。</DIV>\r\n<DIV>五、应当严守规定，不得违规向巡查对象收取任何费用或擅自扣押证照、财物。</DIV>\r\n<DIV>六、应当秉公巡查，不得包庇、纵容违法行为。</DIV>\r\n<DIV>七、应当自慎自重，不得接受巡查对象的礼品和安排的宴请、旅游、消费娱乐等活动。</DIV>\r\n<DIV>八、应当廉洁自律，不得到巡查对象处报销应由个人支付的费用和借钱借物。</DIV>\r\n<DIV>九、应当无私无畏，不得通过巡查对象为个人和亲友谋取不当利益及购物。</DIV>\r\n<DIV>十、应当自警自省，不得与巡查对象一起高消费娱乐，甚至赌博。</DIV>', 'xc_jd_new', null, null, '2010-03-01 15:21:41', '1', 'admin');
INSERT INTO `tbl_yginfo` VALUES ('4', '特种设备安全监察工作暂行规定', '<DIV align=center>&nbsp;</DIV>\r\n<DIV align=center>第一章&nbsp; 总&nbsp; 则</DIV>\r\n<DIV>第一条 为加强特种设备安全监察工作，防止和减少事故，保障人民群众生命和财产安全，促进经济发展，根据《特种设备安全监察条例》和《浙江省特种设备安全管理条例》等法律法规的规定，结合我市实际，制定本规定。</DIV>\r\n<DIV>第二条 按照“政府负总责，职能部门负监管责任，企业负主体责任”的原则，按照《特种设备安全监察条例》（以下简称《条例》）规定，市、县两级质监部门依法对本行政区域内特种设备实施安全监察。</DIV>\r\n<DIV>第三条 本规定所称特种设备是指《特种设备目录》范围内并符合锅炉、压力容器、压力管道、电梯、起重机械、客运索道、大型游乐设施和场（厂）内专用机动车辆相关规范、规程和规定的特种设备。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第二章&nbsp; 职责分工</DIV>\r\n<DIV>第四条 巡查人员职责任务：</DIV>\r\n<DIV>1、宣传特种设备法律、法规、规章和安全技术规范及相关规定；督促特种设备使用单位落实安全主体责任，建立健全安全责任体系、安全组织体系、安全制度体系、事故应急管理体系，主要负责人对本单位特种设备安全全面负责，保证特种设备的安全使用。</DIV>\r\n<DIV>2、日常巡查中要严格 “二有证、一检验”的检查,要检查特种设备使用单位安全主体责任的落实，督促特种设备使用单位完善各项制度和加强特种设备安全知识培训，提高特种设备作业人员的安全操作技能，增强自我防范意识和自我保护能力。重点检查的内容是：</DIV>\r\n<DIV>（1）使用的特种设备是否进行了使用登记，停用的特种设备是否办理了停用手续，报废的特种设备是否办理了注销手续；</DIV>\r\n<DIV>（2）使用的特种设备是否在定期检验有效期内；</DIV>\r\n<DIV>（3）未进行使用登记的特种设备是否有证单位制造、有证单位安装；</DIV>\r\n<DIV>（4）是否对在用特种设备的安全附件进行定期校验；</DIV>\r\n<DIV>（5）是否对特种设备作业人员进行特种设备安全教育和培训；安全管理人员和上岗的作业人员是否具有相应的有效的资格证。</DIV>\r\n<DIV>3、巡查中发现的问题应当书面立即告知被检查单位，提出整改要求，并立即报告本质监局（分局）；同时，对整改结果跟踪落实。</DIV>\r\n<DIV>4、填写《特种设备日常巡查记录表》（见附件），详细记录检查内容、发现问题及处置等情况，经被检查单位的有关负责人签字盖章确认后，及时建立台账并归档。</DIV>\r\n<DIV>第五条 县（市）、区质量技术监督局（分局）职责任务：</DIV>\r\n<DIV>1、贯彻落实特种设备法律、法规、规章和安全技术规范以及上级质监部门和当地政府关于特种设备安全监察工作的部署和要求，结合本地实际，制定并实施特种设备安全监察工作计划；</DIV>\r\n<DIV>2、组织开展本行政区域内特种设备安全的日常巡查，明确日常巡查工作内部职责分工，建立健全相关制度，确保日常巡查工作达到规定要求；负责对日常巡查工作的监督检查；</DIV>\r\n<DIV>3、及时协调处理巡查人员报告的有关问题，依法查处违反《条例》规定和安全技术规范要求的行为；</DIV>\r\n<DIV>4、督促特种设备使用企业落实安全主体责任，履行《条例》规定的要求；</DIV>\r\n<DIV>5、负责分工范围内本行政区域内特种设备小锅炉房审批的行政许可工作；</DIV>\r\n<DIV>6、受理对本行政区域内特种设备生产及使用单位、气瓶定期检验单位违法行为的举报，并及时予以处理；及时处置检验检测机构报告的检验过程中发现的特种设备严重事故隐患；</DIV>\r\n<DIV>7、按照《特种设备现场安全监督检查规则（试行）》和《特种设备重点监控工作要求》，对本行政区域内的特种设备使用单位、重点监控特种设备按年度计划抽查比例进行安全监督检查；组织开展专项整治检查、节假日检查、重大社会活动检查等专项检查；处置检查中发现的问题；</DIV>\r\n<DIV>8、接到事故报告后，应当尽快核实有关情况，按规定要求向当地政府、上级质监部门报告；按规定参加特种设备安全事故调查；对发生事故的单位和有关人员，按照《条例》在职权范围内依法做出行政处理；</DIV>\r\n<DIV>9、督促特种设备使用单位定期开展特种设备事故应急演练；适时组织开展涉及公共安全的特种设备事故应急演练；</DIV>\r\n<DIV>10、负责将本行政区域内有关统计数据、报表等信息及时输入特种设备动态管理信息系统；负责本行政区域内特种设备生产、使用、检验检测和事故等方面数据的统计、汇总和上报工作；负责特种设备安全状况分析；建立健全特种设备安全监察档案；</DIV>\r\n<DIV>11、在实施特种设备安全监察中发现下列情形之一的，应及时报告市质监局：</DIV>\r\n<DIV>（1）依法应当撤销、吊销或者暂停许可证书的违法行为</DIV>\r\n<DIV>（2）拒绝接受检查的违法行为；</DIV>\r\n<DIV>（3）存在区域性或者普遍性的严重事故隐患；</DIV>\r\n<DIV>（4）被检查单位对严重事故隐患不予整改或者消除的；</DIV>\r\n<DIV>12、每年初向当地政府提交特种设备安全监察工作专题报告，总结汇报上年度工作，提出本年度工作重点。并根据工作实际及时报告在履行监察职能中需要政府协调解决的以下问题：</DIV>\r\n<DIV>(1)需要政府牵头组织整治的区域性、行业性特种设备问题；</DIV>\r\n<DIV>(2)需要政府牵头处置的涉及特种设备的重大突发事件；</DIV>\r\n<DIV>(3)根据特种设备实施安全监察工作需要，应配备的人、财、物等能力保障；</DIV>\r\n<DIV>(4)将特种设备实施安全监察工作纳入对各级政府考核体系中。</DIV>\r\n<DIV>第六条 宁波市质量技术监督局职责任务：</DIV>\r\n<DIV>1、贯彻落实特种设备法律、法规、规章和安全技术规范以及上级质监部门和市政府关于特种设备安全监察工作的部署和要求，结合本地实际，制定并实施特种设备安全监察工作计划；</DIV>\r\n<DIV>2、建立健全全市特种设备安全监察工作制度和考评办法；督促、指导和检查县级质监部门特种设备安全监察工作；</DIV>\r\n<DIV>3、及时按规定处置县级质监部门报告的特种设备安全监察中发现的问题；对存在区域性或者普遍性的严重事故隐患进行分析研究，采取在本行政区域内组织排查、整治等措施；</DIV>\r\n<DIV>4、负责分工范围内本行政区域内特种设备的行政许可工作；</DIV>\r\n<DIV>5、接到事故报告后，应当尽快核实有关情况，按规定要求向当地政府、上级质监部门报告；按规定参加或组织特种设备安全事故调查；对发生事故的单位和有关人员，按照《条例》在职权范围内依法做出行政处理；</DIV>\r\n<DIV>6、督促特种设备使用单位定期开展特种设备事故应急演练；适时组织开展涉及公共安全的特种设备事故应急演练；</DIV>\r\n<DIV>7、接受在本行政区域内特种设备安装、改造、维修的施工单位在施工前的书面告知；</DIV>\r\n<DIV>8、受理对本行政区域内特种设备检验检测机构、生产及使用单位违法行为的举报，并及时予以处理；</DIV>\r\n<DIV>9、按照安全技术规范要求对特种设备生产单位、检验检测机构实施安全监察；</DIV>\r\n<DIV>10、负责将本行政区域内有关统计数据、报表等信息及时输入特种设备动态管理信息系统；负责组织本行政区域内特种设备生产、使用、检验检测和事故等方面数据的统计、汇总和上报工作；负责组织特种设备安全状况分析；建立健全特种设备安全监察档案；</DIV>\r\n<DIV>11、发现本行政区域内有下列情形之一的，应及时向上一级质监部门报告：</DIV>\r\n<DIV>（1）依法应当撤销、吊销或者暂停许可证书的违法行为；</DIV>\r\n<DIV>（2）存在区域性或者普遍性的严重事故隐患；</DIV>\r\n<DIV>12、每年初向当地政府提交特种设备安全监察工作专题报告，总结汇报上年度工作，提出本年度工作重点。并根据工作实际及时报告在履行监察职能中需要政府协调解决的以下问题：</DIV>\r\n<DIV>(1)需要政府牵头组织整治的区域性、行业性特种设备安全问题；</DIV>\r\n<DIV>(2)需要政府牵头处置的涉及特种设备的重大突发事件；</DIV>\r\n<DIV>(3)根据特种设备实施安全监察工作需要，应配备的人、财、物等能力保障；</DIV>\r\n<DIV>(4)将特种设备实施安全监察工作纳入对各级政府考核体系中。</DIV>\r\n<DIV>第七条 市局稽查支队职责任务：</DIV>\r\n<DIV>1、根据市质监局部署配合特监处开展特种设备专项执法检查；</DIV>\r\n<DIV>2、负责承办特种设备违法案件查处，以及违法案件遗留安全隐患后处理；</DIV>\r\n<DIV>3、提供涉及特种设备的执法办案信息，及时上报工作中发现的特种设备安全隐患。</DIV>\r\n<DIV>第八条 市特检院职责任务：</DIV>\r\n<DIV>1、依照《条例》规定，进行特种设备检验检测工作；</DIV>\r\n<DIV>2、对特种设备检验检测结果、鉴定结论负责；</DIV>\r\n<DIV>3、应当遵循诚信原则和方便企业的原则，为特种设备生产、使用单位提供可靠、便捷的检验检测服务；对涉及的被检验检测单位的商业秘密，负有保密义务；</DIV>\r\n<DIV>4、不得从事特种设备的生产、销售，不得以其名义推荐或者监制、监销特种设备；</DIV>\r\n<DIV>5、进行特种设备检验检测，发现严重事故隐患，应当及时告知特种设备使用单位，并立即向当地县级质监部门和市质监局报告；</DIV>\r\n<DIV>6、不得利用检验检测工作故意刁难特种设备生产、使用单位；</DIV>\r\n<DIV>7、对报检的特种设备，应及时按照安全技术规范的要求，对特种设备进行安全性能检验；</DIV>\r\n<DIV>8、提供特种设备生产监督检验、定期检验情况及其发现问题等统计分析；上报本行政区域内特种设备生产监督检验、检验检测等方面数据；</DIV>\r\n<DIV>9、协助现场巡查，配合市、县两级质监部门的特种设备安全监察工作，起好技术支撑作用。</DIV>\r\n<DIV>10、及时开展特种设备作业人员培训。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第三章&nbsp; 责任追究</DIV>\r\n<DIV>第九条 巡查人员未按本规定要求履职且出现下列情形之一的，分别给予批评教育、考核奖惩挂钩、组织处理等形式的责任追究：</DIV>\r\n<DIV>1、未按要求履行特种设备日常巡查职责任务的；</DIV>\r\n<DIV>2、发现违反《条例》规定和安全技术规范要求的行为或者发现在用特种设备存在事故隐患的，未及时提出责令改正要求或者制止的；</DIV>\r\n<DIV>3、未及时按规定履行报告职责的。</DIV>\r\n<DIV>第十条 县（市）、区质量技术监督局（分局）未按本规定要求履职且出现下列情形之一的，视情取消该单位年度考核中评优、评先或单项奖评选资格，并分别给予相关人员批评教育、考核奖惩挂钩、组织处理等形式的责任追究：</DIV>\r\n<DIV>1、对上级质监部门和当地政府关于特种设备安全监察工作的要求，不贯彻执行，不安排落实，造成安全监察缺失的；</DIV>\r\n<DIV>2、辖区内发生与安全监察责任有关的特种设备事故的；</DIV>\r\n<DIV>3、对特种设备专项整治不力，导致未在规定时间内通过整治验收的；</DIV>\r\n<DIV>4、未建立健全特种设备安全监察工作制度规定，造成责任不清、推诿扯皮的；</DIV>\r\n<DIV>5、对巡查、监管、执法人员的履职情况不开展监督检查，导致特种设备安全监察工作秩序混乱的；</DIV>\r\n<DIV>第十一条 市局稽查支队未按本规定要求履职且出现下列情形之一的，视情取消该单位年度考核中评优或评先资格，并分别给予相关人员批评教育、考核奖惩挂钩、组织处理等形式的责任追究：</DIV>\r\n<DIV>1、发现特种设备违法行为没有及时组织查处的；</DIV>\r\n<DIV>2、承办市质监局交办的工作任务时，出现推诿扯皮现象的；</DIV>\r\n<DIV>3、未及时上报工作中发现的特种设备安全隐患，造成事态扩大的。</DIV>\r\n<DIV>第十二条 市特检院未按本规定要求履职且出现下列情形之一的，视情取消该单位年度考核中评优、评先或单项奖评选资格，并分别给予相关人员批评教育、考核奖惩挂钩、组织处理等形式的责任追究：</DIV>\r\n<DIV>1、出现严重工作质量问题，受到省质监局、市质监局通报批评的；</DIV>\r\n<DIV>2、承办市质监局交办的工作任务时，出现推诿扯皮现象的；</DIV>\r\n<DIV>3、被特种设备生产、使用单位投诉，情况属实，造成负面影响的。</DIV>', 'xc_ts_new', null, null, '2010-03-01 15:39:25', '1', 'admin');
INSERT INTO `tbl_yginfo` VALUES ('5', '特种设备日常巡查工作规范', '<DIV align=center>第一章 总&nbsp; 则</DIV>\r\n<DIV>第一条 为了规范特种设备现场巡查处置行为，进一步落实工作职责，及时消除隐患，特制定本规范。</DIV>\r\n<DIV>第二条 本规范适用于宁波市各级质量技术监督部门对特种设备生产、使用单位现场巡查时发现问题的处置。</DIV>\r\n<DIV>本规范所指的特种设备，仅是《特种设备目录》范围内并符合锅炉、压力容器、压力管道、电梯、起重机械、客运索道、大型游乐设施和场（厂）内专用机动车辆相关规范、规程和规定的特种设备。</DIV>\r\n<DIV>第三条 工作依据:</DIV>\r\n<DIV>1、《特种设备安全监察条例》（国务院令第549号）</DIV>\r\n<DIV>2、关于实施《特种设备安全监察条例》若干问题的意见&nbsp;(国质检法[2003]206号)</DIV>\r\n<DIV>3、关于实施新修改的《特种设备安全监察条例》若干问题的意见(国质检法〔2009〕192号)</DIV>\r\n<DIV>4、《浙江省特种设备安全监察条例》</DIV>\r\n<DIV>5、宁波市特种设备安全监察工作暂行规定（甬质发[2009]65号）</DIV>\r\n<DIV>6、《特种设备现场安全监督检查规则（试行）》（国质检特函〔2007〕910号）</DIV>\r\n<DIV>7、关于起重机械专项治理工作有关问题的通知(国质检特函〔2007〕901号)</DIV>\r\n<DIV>8、有关特种设备安全技术规范</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第二章&nbsp; 巡查要求</DIV>\r\n<DIV>第四条 县（市）区质监局（分局）</DIV>\r\n<DIV>1、现场巡查发现特种设备存在隐患的，应及时督促使用单位落实整改，并抄报特监科。</DIV>\r\n<DIV>2、及时梳理、汇总现场巡查发现的隐患，及时按规定处置严重事故隐患，尤其是“三无”违法行为的查处。对存在严重事故隐患的单位，应及时依法查处。 </DIV>\r\n<DIV>3、建立隐患台帐，切实做好严重事故隐患的整改督促、查处登记工作。</DIV>\r\n<DIV>第五条 市特种设备检验研究院(以下简称“市特检院”)</DIV>\r\n<DIV>1、协助现场巡查，为巡查工作提供技术支撑。</DIV>\r\n<DIV>2、对报检的特种设备，及时实施检验。</DIV>\r\n<DIV>3、对检验结果判为限定条件使用的特种设备，以及发现存在严重事故隐患的特种设备，应及时书面告知使用单位，并及时书面报告所在地县（市）区质监局（分局）特监科，并抄报市局特种设备安全监察处。</DIV>\r\n<DIV>4、及时开展特种设备作业人员培训。</DIV>\r\n<DIV>第六条 市局特种设备安全监察处</DIV>\r\n<DIV>1、分析、研究县（市）区质监局（分局）特监科和市特检院上报的特种设备安全风险信息，督促指导县（市）区局（分局）及时处置。</DIV>\r\n<DIV>2、协调、督促检验和培训工作的规范开展。</DIV>\r\n<DIV>3、督促县（市）区质监局（分局）做好特种设备严重事故隐患和 “三无”违法行为的查处。</DIV>\r\n<DIV>第七条 严重事故隐患的查处</DIV>\r\n<DIV>严重事故隐患是指特种设备本身或使用管理上未采取有效监控措施时，可能导致人身伤害、恶劣社会影响或较大财产损失的缺陷。</DIV>\r\n<DIV>按照国家质检总局《关于实施〈特种设备安全监察条例〉若干问题的意见》(国质检法[2003]206号)的规定，特种设备的监察范围按国家质检总局制订、国务院批准的《特种设备目录》确定，对如下情形之一的，可以认定为严重事故隐患：</DIV>\r\n<DIV>1、使用非法生产特种设备的；</DIV>\r\n<DIV>2、超过特种设备的规定参数范围使用的；</DIV>\r\n<DIV>3、缺少安全附件、安全装置，或者安全附件、安全装置失灵而继续使用的；</DIV>\r\n<DIV>4、使用应当予以报废或者经检验检测判为不合格的特种设备的； </DIV>\r\n<DIV>5、使用有明显故障、异常情况的特种设备，或者使用经责令改正而未予改正的特种设备的； </DIV>\r\n<DIV>6、特种设备发生事故不予报告而继续使用的。</DIV>\r\n<DIV>使用单位存在上述问题的，各县（市）区质监局（分局）应以书面形式及时发出特种设备安全监察指令书，责令使用单位在特种设备隐患未得到有效消除前不得投入使用，及时依法查处。</DIV>\r\n<DIV>对因特殊原因无法立即停用的严重事故隐患设备，应在使用单位保证落实相应监控措施和应急救援措施的同时，将严重事故隐患情况报告当地人民政府和其它有关部门，商定处理意见。</DIV>\r\n<DIV>第八条 现场巡查应认真填写《特种设备日常巡查记录表》（详见附件一），详细记录巡查的内容、发现的问题、处置情况；对实施现场安全监督检查的，还应按规定填写《特种设备现场安全监督检查记录》，并及时输入数据库；上述检查记录，均需由被查单位签署对检查内容和记录的意见，并存档备查。同时，现场巡查还需对整改结果跟踪落实。</DIV>\r\n<DIV>现场巡查结束后，要定期对发现的问题和处置情况进行综合分析，形成分析报告。每季度的第一个月5日前应将上一季度分析报告上报市局特种设备安全监察处。</DIV>\r\n<DIV>第九条 现场巡查发现使用未办理注册登记的、未办理报停手续的、未办理注销手续的、超期未检的特种设备，安全附件超期未检（校）验的，应及时依法查处，并按附件二的要求处置。</DIV>\r\n<DIV>对使用超期未检申报检验的，市特检院应及时安排，在规定的期限内实施检验。</DIV>\r\n<DIV>第十条 巡查人员现场巡查过程中，发现使用单位存在下列情况的，应督促使用单位及时整改：</DIV>\r\n<DIV>⑴、未建立特种设备安全管理规章制度；</DIV>\r\n<DIV>⑵、未建立安全管理机构或专（兼）职管理人员；</DIV>\r\n<DIV>⑶、未落实各级安全责任人员；</DIV>\r\n<DIV>⑷、特种设备作业人员未进行特种设备安全教育和培训或无培训记录；</DIV>\r\n<DIV>⑸、未制定特种设备事故专项应急救援预案或无演练记录；</DIV>\r\n<DIV>⑹、未建立、健全特种设备安全技术档案；</DIV>\r\n<DIV>⑺、未对特种设备进行日常维护保养、定期检查或无记录。</DIV>\r\n<DIV>第十一条 有关具体事项的处置</DIV>\r\n<DIV>1、使用未办理注册登记的特种设备的</DIV>\r\n<DIV>现场巡查发现使用未办理注册登记的特种设备，应分清原因，并按下列要求处置：</DIV>\r\n<DIV>（1）设备铭牌、设计、制造、安装等技术资料齐全的。巡查人员应督促使用单位办理注册登记，并及时依法查处。超过检验周期的，应督促使用单位向市特检院申报检验，在检验合格后办理注册登记手续。</DIV>\r\n<DIV>对于符合《简单压力容器安全技术监察规程》第三条适用范围的储气罐等简单压力容器，可按《简单压力容器安全技术监察规程》第六章的规定进行使用管理，不需办理使用登记。</DIV>\r\n<DIV>（2）设备铭牌、设计、制造、安装等技术资料不齐全的。</DIV>\r\n<DIV>对有铭牌，无设计、制造等技术资料的，巡查人员应确认铭牌上的制造单位是否有相应的制造资格。无相应制造资格或不能确定的，巡查人员应及时依法查处。对有相应制造许可证单位的产品，应督促使用单位向原制造单位补齐安全技术规范规定的产品质量证明文件等资料，并按规定程序办理注册登记；若安全技术规范规定的产品质量证明文件等资料不能补齐的，应及时督促使用单位申报检验，检验机构应按制造检验要求实施检验检测，检验合格后方可办理注册登记手续。</DIV>\r\n<DIV>对无铭牌并无设计、制造、安装等技术资料的，按存在严重事故隐患处置，巡查人员应及时依法查处。其中，对铭牌、技术资料不齐全的起重机械，巡查人员应督促使用单位委托有相应资质的制造、改造单位进行评估判定或改造，补齐有关技术资料并出具评估判定报告或改造质量证明书后申报检验，检验合格后办理注册登记。</DIV>\r\n<DIV>对有相应制造许可证单位制造而由无相应资格单位安装的，巡查人员应及时依法查处。使用单位可选择具有相应资格的安装单位实施重新安装，检验合格后方可注册登记。</DIV>\r\n<DIV>2、使用超期未检的特种设备的</DIV>\r\n<DIV>巡查人员应督促使用单位向市特检院申报检验，并及时依法查处。市特检院应及时安排，在规定的期限内实施检验。</DIV>\r\n<DIV>3、使用安全附件超期未检（校）验的特种设备的</DIV>\r\n<DIV>巡查人员应及时依法查处，并责令使用单位停止使用该设备并督促使用单位及时送检（校）验， </DIV>\r\n<DIV>4、特种设备作业无证人员操作特种设备的</DIV>\r\n<DIV>巡查人员应及时依法查处。</DIV>\r\n<DIV>5、设备已停止使用，未办理报停手续的</DIV>\r\n<DIV>巡查人员应督促使用单位及时办理相关手续。</DIV>\r\n<DIV>6、设备已报废，未办理注销手续的</DIV>\r\n<DIV>巡查人员应督促使用单位办理注销手续。</DIV>\r\n<DIV>&nbsp;</DIV>', 'xc_ts_new', null, null, '2010-03-01 15:43:17', '1', 'admin');
INSERT INTO `tbl_yginfo` VALUES ('6', '民生计量监管工作暂行规定', '<DIV align=center>第一章&nbsp; 总&nbsp; 则</DIV>\r\n<DIV>第一条　为加强宁波市民生计量监督管理，科学界定民生计量监管职责，保证国家计量单位制的统一和量值的准确可靠，维护市场经济秩序，根据《中华人民共和国计量法》等有关法律法规的规定，结合宁波实际，制定本暂行规定。</DIV>\r\n<DIV>第二条　按照“政府负总责，职能部门负监管责任，企业负主体责任”的原则，市、县两级质量技术监督局是本辖区计量行政主管部门，负责依法做好辖区内民生计量监管工作。</DIV>\r\n<DIV>第三条　本规定所称民生计量是指与人民群众安全健康和切身利益密切相关的计量，涉及集贸市场、医疗、交通、民用四表、加油站、液化气充装站等六大领域，包括制造、修理、销售及使用计量器具等行为。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第二章　职责分工</DIV>\r\n<DIV>第四条　巡查人员职责任务：</DIV>\r\n<DIV>（一）宣传计量法律法规及相关规定要求，告知企业行政许可、相关政策等信息；</DIV>\r\n<DIV>（二）严格开展日常巡查；</DIV>\r\n<DIV>（三）对巡查中发现的问题，根据有关规定进行处置；</DIV>\r\n<DIV>（四）跟踪了解企业信息变更情况，及时更新监管档案；</DIV>\r\n<DIV>（五）及时上报巡查中发现的涉及民生计量可能造成群发性事件的隐患。</DIV>\r\n<DIV>第五条　县（市）、区质量技术监督局（分局）职责任务：</DIV>\r\n<DIV>（一）贯彻落实上级质量技术监督局和当地政府关于民生计量监管工作的部署和要求，依法履行辖区内民生计量监管责任；</DIV>\r\n<DIV>（二）收集、汇总、分析辖区内民生计量监管信息；每年初向当地政府提交民生计量监管工作专题报告，总结汇报上年度工作，提出本年度工作重点。并根据工作实际及时报告在履行监督职能中需要政府协调解决的以下问题：</DIV>\r\n<DIV>1、需要政府牵头组织整治的民生计量问题；</DIV>\r\n<DIV>2、需要政府牵头处置的涉及民生计量的重大突发事件；</DIV>\r\n<DIV>3、根据民生计量监管工作需要，应配备的人、财、物等能力保障；</DIV>\r\n<DIV>4、将民生计量监管工作纳入对各级政府考核体系中。</DIV>\r\n<DIV>（三）建立与民生计量监管相适应的社会公用计量标准；</DIV>\r\n<DIV>（四）落实具体监管人员，明确职责分工，并为监管人员提供必须的工作条件；实施培训或提供监管人员业务培训机会，提高其监管能力；对巡查人员的工作开展监督检查；</DIV>\r\n<DIV>（五）按市质量技术监督局统一部署，加强集贸市场、医疗、交通、民用四表、加油站、液化气充装站等六大民生计量领域监管，确保六大领域强检计量器具受检率全覆盖；</DIV>\r\n<DIV>（六）负责处理、上报本行政区域内计量违法案件和民生计量可能造成的群发性事件；</DIV>\r\n<DIV>（七）组织开展辖区内民生计量产品、定量包装商品的监督抽查，配合市质量技术监督局开展民生计量产品、定量包装商品的监督检查和民生计量专项执法检查；<B></B></DIV>\r\n<DIV>（八）督促承担强检任务的计量检定机构及时做好辖区内民生计量器具强检和“宁波市强检管理系统”的日常维护工作； </DIV>\r\n<DIV>（九）承担辖区内获证企业的证后监管；及时向行政审批部门、检定机构通报日常监管中发现的涉及行政许可、监督抽查工作质量的相关问题；</DIV>\r\n<DIV>第六条　宁波市质量技术监督局职责任务：</DIV>\r\n<DIV>（一）根据计量法律法规的规定和市政府的统一部署，负责全市民生计量监管工作，确保全市质监系统依法履行对民生计量监管责任；</DIV>\r\n<DIV>（二）收集、汇总、分析全市民生计量监管信息，每年初向当地政府提交民生计量监管工作专题报告，总结汇报上年度工作，提出本年度工作重点。并根据工作实际及时报告在履行监督职能中需要政府协调解决的以下问题：</DIV>\r\n<DIV>1、需要政府牵头组织整治的民生计量问题；</DIV>\r\n<DIV>2、需要政府牵头处置的涉及民生计量的重大突发事件；</DIV>\r\n<DIV>3、根据民生计量监管工作需要，应配备的人、财、物等能力保障；</DIV>\r\n<DIV>4、将民生计量监管工作纳入对各级政府考核体系中。</DIV>\r\n<DIV>（三）统筹规划全市计量监管体系，保证民生计量监管工作必须的人、财、物；</DIV>\r\n<DIV>（四）提出市级年度计量产品监督抽查计划；组织开展计量产品质量监督抽查和定量包装商品计量监督抽查；</DIV>\r\n<DIV>（五）统筹规划全市民生计量量传体系，督促法定计量检定机构按规划要求建立社会公用计量标准，确保市、县两级民生计量量传体系建设与全市民生计量监管需要相适应；</DIV>\r\n<DIV>（六）负责对全市法定计量检定机构监管，组织开展全市计量比对工作；督促市级法定计量检定机构及县级质量技术监督局依法履行强检职责，定期通报民生计量强检工作进展情况；</DIV>\r\n<DIV>（七）根据需要组织开展全市民生计量专项执法检查和计量专项整治活动；</DIV>\r\n<DIV>（八）制订民生计量日常巡查、实地核查的内容、程序、工作要求；组织全市民生计量监管人员的业务培训，帮助监管人员提高监管水平；组织开展对县（市）、区局（分局）民生计量监管工作的监督检查；</DIV>\r\n<DIV>（九）承担上级部署的其他民生计量工作任务。</DIV>\r\n<DIV>第七条　市局稽查支队职责任务：</DIV>\r\n<DIV>负责计量违法案件的查处，协助开展民生计量专项执法检查，及时上报查处（检查）情况、检查中发现的涉及民生计量可能造成群发性事件的隐患。</DIV>\r\n<DIV>第八条　法定计量检定机构职责任务：</DIV>\r\n<DIV>（一）承担计量产品质量监督抽查和商品量计量监督抽查任务，并按时上报监督抽查分析报告；</DIV>\r\n<DIV>（二）按照规划完成民生计量建标工作；在规定期限内完成民生计量器具的强检工作，并递交各行业年度计量分析报告；及时向市、县级质量技术监督局报告（反馈）工作中发现的计量违法行为，涉及民生计量可能造成群发性事件的隐患；</DIV>\r\n<DIV>（三）建立完善单位内部计量管理系统，并与“宁波市强检管理系统”链接，确保“宁波市强检管理系统”的动态维护；</DIV>\r\n<DIV>（四）按规定完成计量技术考核任务；</DIV>\r\n<DIV>（五）配合做好计量行政执法检查和计量投诉处理工作。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第三章　责任追究</DIV>\r\n<DIV>第九条　巡查人员未按本规定要求履职且出现下列情形之一的，按照相关规章制度和法律法规的规定分别给予批评教育、考核奖惩挂钩、组织处理等形式的责任追究：</DIV>\r\n<DIV>（一）未按要求履行民生计量日常巡查职责，或发现民生计量违法行为，不制止，不查处的；</DIV>\r\n<DIV>（二）发现涉及民生计量可能造成群发性事件的隐患，未及时上报，导致被媒体曝光或上级部门通报的。</DIV>\r\n<DIV>第十条　县（市）、区质量技术监督局（分局）未按本规定要求履职且出现下列情形之一的，视情取消该单位年度考核中评优或相应的单项奖评选资格，并按规定给予相关人员批评教育、考核奖惩挂钩、组织处理等形式的责任追究：</DIV>\r\n<DIV>（一）对上级质量技术监督局和当地政府关于民生计量监管工作的要求，不贯彻执行，不安排落实，造成监管缺失的；</DIV>\r\n<DIV>（二）监管不到位，导致辖区内发生民生计量群发性事件的；</DIV>\r\n<DIV>（三）处置民生计量突发事件不及时，该报告的不报告或拖延报告，导致事态扩大或造成严重后果的；</DIV>\r\n<DIV>（四）发生区域性计量产品质量问题的；</DIV>\r\n<DIV>（五）未建立健全民生计量监管工作制度，造成责任不清、推诿扯皮的；</DIV>\r\n<DIV>（六）对巡查、监管、执法人员的履职情况不开展监督检查，导致民生计量监管工作秩序混乱的。</DIV>\r\n<DIV>第十一条　法定计量检定机构未按本规定要求履职且出现下列情形之一的，视情取消该单位年度考核中评优或相应的单项奖评选资格，并按规定给予相关人员批评教育、考核奖惩挂钩、组织处理等形式的责任追究：</DIV>\r\n<DIV>（一）未及时安排强检工作，未及时对“宁波市强检管理系统”进行维护的，影响监管工作顺利进行；或未及时上报民生计量可能造成群发性事件隐患的； </DIV>\r\n<DIV>（二）工作出现严重工作质量问题，受到省、市质量技术监督局通报批评或导致计量行政诉讼败诉的；</DIV>\r\n<DIV>（三）计量检定人员违反检定规程进行计量检定、伪造检定数据等，造成恶劣影响的。</DIV>\r\n<DIV>（四）违反监督抽查相关规定，情节严重影响后处理工作进行的。</DIV>\r\n<DIV>第十二条　市局稽查支队未按本规定要求履职且出现下列情形之一的，视情取消该单位年度考核中评优相应的单项奖评选资格，并按规定给予相关人员批评教育、考核奖惩挂钩、组织处理等形式的责任追究：</DIV>\r\n<DIV>（一）对民生计量严重违法行为没有及时组织查处的；</DIV>\r\n<DIV>（二）未及时上报民生计量可能造成群发性事件隐患的。</DIV>', 'xc_jl_new', null, null, '2010-03-01 15:44:27', '1', 'admin');
INSERT INTO `tbl_yginfo` VALUES ('7', '食品生产加工企业日常巡查工作规范', '<DIV align=center>第一章&nbsp; 总&nbsp; 则</DIV>\r\n<DIV>第一条　为督促食品生产加工企业（以下简称企业）落实质量安全主体责任，规范食品质量安全日常巡查工作，保障食品质量安全，依据《食品安全法》及其实施条例、国家质检总局有关企业落实质量安全主体责任监督检查规定，制定本规范。</DIV>\r\n<DIV>第二条&nbsp; 本规范所指企业是指依据《食品安全法》等法律规定取得食品生产许可的食品生产者。</DIV>\r\n<DIV>第三条　各县（市）、区局（分局）（以下简称县级局）依法对企业执行有关法律法规和标准等情况实施日常巡查，适用本规范。</DIV>\r\n<DIV>第四条&nbsp; 市局负责按上级质监部门有关规定制（修）订企业落实质量安全主体责任日常巡查规范，并对县级局依据本规范实施日常巡查的情况进行指导检查。</DIV>\r\n<DIV>县级局负责组织实施本辖区企业落实质量安全主体责任日常巡查工作，并提供必要的保障。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第二章&nbsp; 企业质量安全主体责任</DIV>\r\n<DIV>第五条&nbsp; 企业应保持资质的一致性。</DIV>\r\n<DIV>（一）企业实际生产食品的场所、生产食品的范围等应与食品生产许可证书内容一致； </DIV>\r\n<DIV>（二）企业在生产许可证有效期内，生产条件、检验手段、生产技术或者工艺发生变化的，应按规定报告； </DIV>\r\n<DIV>（三）食品生产许可证载明的企业名称应与营业执照一致。</DIV>\r\n<DIV>第六条&nbsp; 企业应建立进货查验记录制度。</DIV>\r\n<DIV>（一）企业采购食品原料、食品添加剂、食品相关产品应建立和保存进货查验记录，向供货者索取许可证复印件（指按照相关法律法规规定，应当取得许可的）和购进批次产品相适应的合格证明文件；</DIV>\r\n<DIV>（二）对供货者无法提供有效合格证明文件的食品原料，企业应依照食品安全标准自行检验或委托检验，并保存检验记录；</DIV>\r\n<DIV>（三）企业采购进口需法定检验的食品原料、食品添加剂、食品相关产品的，应当向供货者索取有效的检验检疫证明； </DIV>\r\n<DIV>（四）企业生产加工食品所使用的食品原料、食品添加剂、食品相关产品的品种应与进货查验记录内容一致； </DIV>\r\n<DIV>（五）企业应建立和保存各种购进食品原料、食品添加剂、食品相关产品的贮存、保管、领用出库等记录；</DIV>\r\n<DIV>（六）企业不应使用回收食品作为食品原料生产加工食品。</DIV>\r\n<DIV>第七条&nbsp; 企业应建立生产过程控制制度。</DIV>\r\n<DIV>（一）企业应定期对厂区内环境、生产场所和设施清洁卫生状况自查，并保存自查记录；</DIV>\r\n<DIV>（二）企业应定期对必备生产设备、设施维护保养和清洗消毒，并保存记录，同时应建立和保存停产复产记录及复产时生产设备、设施等安全控制记录；</DIV>\r\n<DIV>（三）企业应建立和保存生产投料记录，包括投料种类、品名、生产日期或批号、使用数量等；</DIV>\r\n<DIV>（四）企业应建立和保存生产加工过程关键控制点的控制情况，包括必要的半成品检验记录、温度控制、车间洁净度控制等；</DIV>\r\n<DIV>（五）企业生产现场，应避免人流、物流交叉污染，避免原料、半成品、成品交叉污染，保证设备、设施正常运行，现场人员应进行卫生防护，不应使用回收食品等。</DIV>\r\n<DIV>第八条&nbsp; 企业应建立出厂检验记录制度。</DIV>\r\n<DIV>（一）企业应建立和保存出厂食品的原始检验数据和检验报告记录，包括查验食品的名称、规格、数量、生产日期、生产批号、执行标准、检验结论、检验人员、检验合格证号或检验报告编号、检验时间等记录内容；</DIV>\r\n<DIV>（二）企业的检验人员应具备相应能力；</DIV>\r\n<DIV>（三）企业委托其他检验机构实施产品出厂检验的，应检查受委托检验机构资质，并签订委托检验合同；</DIV>\r\n<DIV>（四）出厂检验项目与食品安全标准及有关规定的项目应保持一致；</DIV>\r\n<DIV>（五）企业应具备必备的检验设备，计量器具应依法经检验合格或校准，相关辅助设备及化学试剂应完好齐备并在有效使用期内；</DIV>\r\n<DIV>（六）企业自行进行产品出厂检验的应按规定进行实验室测量比对，建立并保存比对记录；</DIV>\r\n<DIV>（七）企业应按规定保存出厂检验留存样品，保存期限不得少于产品的保质期；产品保质期超过2年的，原则上保存期限不得少于2年。</DIV>\r\n<DIV>第九条&nbsp; 企业应建立不合格品管理制度。</DIV>\r\n<DIV>（一）企业应建立和保存采购的不合格食品原料、食品添加剂、食品相关产品的处理记录；</DIV>\r\n<DIV>（二）企业应建立和保存生产的不合格产品的处理记录。</DIV>\r\n<DIV>第十条&nbsp; 企业生产加工食品的标识标注内容应符合法律、法规、规章及食品安全标准规定的事项。</DIV>\r\n<DIV>第十一条&nbsp; 企业应建立销售台帐。企业应对销售每批产品建立和保存销售台帐，包括产品名称、数量、生产日期、生产批号、购货者名称及联系方式、销售日期、出货日期、地点、检验合格证号、交付控制、承运者等内容。</DIV>\r\n<DIV>第十二条&nbsp; 企业标准执行应符合相关法律法规规定。</DIV>\r\n<DIV>（一）企业标准应按规定进行备案；</DIV>\r\n<DIV>（二）企业应收集、记录新发布国家食品安全标准，参加相关培训，做好标准执行工作。</DIV>\r\n<DIV>第十三条&nbsp; 企业应建立不安全食品召回制度。企业应建立和保存对不安全食品自主召回、被责令召回的执行情况的记录，包括：企业通知召回的情况；实际召回的情况；对召回产品采取补救、无害化处理或销毁的记录，整改措施的落实情况；向当地政府和县级以上监管部门报告召回及处理情况。</DIV>\r\n<DIV>第十四条&nbsp; 企业从业人员健康和培训应符合相关法律法规规定。</DIV>\r\n<DIV>（一）企业应建立从业人员健康检查制度和健康档案制度，保存对直接接触食品人员健康管理的相关记录；</DIV>\r\n<DIV>（二）企业应建立和保存对从业人员的食品质量安全知识培训记录。</DIV>\r\n<DIV>第十五条&nbsp; 企业接受委托加工食品应符合相关法律法规规定。</DIV>\r\n<DIV>（一）生产企业接受委托应到所在地质量技术监督部门备案，并保存包括备案证明材料、委托加工合同（或复印件）等相关材料；</DIV>\r\n<DIV>（二）委托加工食品包装标识应符合相关规定。</DIV>\r\n<DIV>第十六条&nbsp; 企业应建立消费者投诉受理制度。企业应建立和保存对消费者投诉的受理记录。包括投诉者姓名、联系方式、投诉的食品名称、数量、生产日期或生产批号、投诉质量问题、企业采取的处理措施、处理结果等。</DIV>\r\n<DIV>第十七条&nbsp; 企业应主动收集企业内部发现的和国家发布的与企业相关的食品安全风险监测和评估信息，并做出反应，同时应建立和保存相关记录。</DIV>\r\n<DIV>第十八条&nbsp; 企业应按规定妥善处置食品安全事故。</DIV>\r\n<DIV>（一）企业应制定食品安全事故处置方案；</DIV>\r\n<DIV>（二）企业应定期检查各项食品安全防范措施的落实情况；</DIV>\r\n<DIV>（三）如果发生食品安全事故，企业应建立和保存处置食品安全事故的记录。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第三章&nbsp; 日常巡查程序</DIV>\r\n<DIV>第十九条　县级局应根据地方政府组织制定的食品安全年度监管计划，编制本辖区企业年度日常巡查计划，并报市局备案。</DIV>\r\n<DIV>县级局可根据食品的季节性生产特点，结合上级质监部门工作部署、年度监督检查计划、年度监督抽查计划和其他监管工作需要，对年度日常巡查计划进行调整。</DIV>\r\n<DIV>第二十条　原则上每家企业每年巡查不少于1次。县级局应对上年度或当年度有下列不良信用记录的企业增加巡查频次：</DIV>\r\n<DIV>（一）发生食品安全事故的； </DIV>\r\n<DIV>（二）各级产品质量监督抽查不合格的；</DIV>\r\n<DIV>（三）因质量问题被立案查处的；</DIV>\r\n<DIV>第二十一条&nbsp; 日常巡查应当有2名以上（含2名）巡查人员参加。巡查人员在巡查时应出示有效证件。</DIV>\r\n<DIV>第二十二条　巡查人员应按下列项目和要求开展巡查：</DIV>\r\n<DIV>（一）必查项</DIV>\r\n<DIV>1、检查生产场所。生产车间和库房是否整洁，防尘、防蝇、防鼠措施和洗手、消毒、更衣设施是否运行正常，工作人员是否穿戴工作衣帽，现场是否有非食品原料、有毒有害物质、回收食品堆放。</DIV>\r\n<DIV>2、检查采购验证。库房内或正在使用的食品原辅料、包装材料以及外协加工品，是否具有相应的许可证明、检验报告或者企业自检（委检）报告，是否与进货查验记录一致。</DIV>\r\n<DIV>3、检查添加剂管理。库房内或正在使用的食品添加剂是否已向当地质监部门申报，是否存在违法添加非食用物质或者超范围使用食品添加剂等行为。</DIV>\r\n<DIV>4、检查出厂检验。出厂检验设备是否齐全、完好，合格品库房内的食品是否有对应的出厂检验报告和原始检验数据、是否与出厂检验记录一致、食品是否已留样并与留样记录一致，食品的标签、说明书是否符合规定。</DIV>\r\n<DIV>（二）选择项</DIV>\r\n<DIV>5、检查许可情况。企业是否存在未经许可超范围生产的行为，是否存在食品安全企业标准未按规定备案的行为，是否存在未经过安全性评估使用新食品原料或者生产食品添加剂新品种、食品相关产品新品种的行为。</DIV>\r\n<DIV>6、检查管理制度。企业是否按《食品安全法》的规定建立健全、有效的食品安全管理制度和生产过程控制要求。</DIV>\r\n<DIV>（三）加强项</DIV>\r\n<DIV>按照市局风险分析处置要求，增加对相关食品生产企业的特定内容进行检查。</DIV>\r\n<DIV>巡查人员在巡查时发现选择项情况出现异常情况时，应对该选择项进行检查；巡查人员对有不良信用企业进行加严巡查时，应对选择项进行检查。</DIV>\r\n<DIV>第二十三条　巡查人员在巡查时应主动向企业宣传食品质量安全法律法规，按照市局食品风险分析处置要求告知企业有关食品安全标准更新、行政许可、质量安全预警、质量安全整治等相关信息和要求，询问企业负责人是否存在不符合法定要求的情况或禁止行为，要求其作出承诺。</DIV>\r\n<DIV>第二十四条　巡查人员应按《宁波市食品生产企业日常巡查记录表》(附件1)如实记录巡查情况和处理结果，并及时录入宁波市质量安全巡查平台。巡查记录一式二份，须经巡查人员和企业法定代表人或其授权的人员签字，一份留存企业，一份存档。</DIV>\r\n<DIV>企业拒绝签字的，由巡查人员书面记录后存档。</DIV>\r\n<DIV>第二十五条&nbsp; 巡查人员遇到有下列情形之一的，可以对相关产品进行抽样：</DIV>\r\n<DIV>（一）现场发现可疑物质、有必要对食品进行检验的；</DIV>\r\n<DIV>（二）有定期或者专项食品质量监督抽查计划的；</DIV>\r\n<DIV>（三）食品质量监督抽查后处理有要求的。</DIV>\r\n<DIV>巡查人员抽样应按《浙江省产品质量监督抽查工作规程》执行。封样时，应当有防拆封措施。对保质期较短的样品应及时送样至法定检验机构。在抽样、送样过程中需要冷藏等特别防护的样品要按规定进行防护。</DIV>\r\n<DIV>第二十六条　对因转产、停产等原因导致无法巡查、抽样的，巡查人员应当现场确认后，记入巡查表并签字存档。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第四章&nbsp; 日常巡查结果处置</DIV>\r\n<DIV>第二十七条　对在日常巡查中发现的问题，巡查人员应根据法律法规和《宁波市质监系统日常巡查发现问题处置规定》的规定，并按照以下具体要求予以处置：</DIV>\r\n<DIV>（一）发现企业有下列情形之一的，巡查人员应发出《食品生产企业质量安全监督警告书》(附件2)，责令改正，给予警告，并跟踪落实到位：</DIV>\r\n<DIV align=left>1、未对采购的食品原料和生产的食品、食品添加剂、食品相关产品进行检验；</DIV>\r\n<DIV align=left>2、未建立并遵守出厂检验记录制度或者未对产品进行出厂检验的；</DIV>\r\n<DIV align=left>　　3、食品安全企业标准未按规定备案；</DIV>\r\n<DIV align=left>4、未按规定要求贮存、销售食品或者清理库存食品；</DIV>\r\n<DIV align=left>5、进货时未查验许可证和相关证明文件；</DIV>\r\n<DIV align=left>6、食品、食品添加剂的标签、说明书涉及疾病预防、治疗功能；</DIV>\r\n<DIV align=left>7、安排患有《食品安全法》第三十四条所列疾病的人员从事接触直接入口食品的工作；</DIV>\r\n<DIV align=left>　　8、发生食品安全事故后未进行处置、报告。</DIV>\r\n<DIV>（二）发现企业有下列情形之一的，巡查人员应当转立案查处：</DIV>\r\n<DIV>1、未经许可从事食品生产，或者利用新的食品原料从事食品生产或者从事食品添加剂新品种、食品相关产品新品种生产，未经过安全性评估的；</DIV>\r\n<DIV align=left>2、采购、使用不符合食品安全标准的食品原料、食品添加剂、食品相关产品的；</DIV>\r\n<DIV align=left>3、用非食品原料或者用回收食品生产食品的，在食品中添加食品添加剂以外的化学物质和其他可能危害人体健康的物质；</DIV>\r\n<DIV align=left>4、生产国家为防病等特殊需要明令禁止生产的食品；</DIV>\r\n<DIV align=left>　　5、预包装食品无标签的或者标签、说明书不符合规定的；</DIV>\r\n<DIV>6、在质监部门责令召回不符合食品安全标准的食品后，仍拒不召回的；</DIV>\r\n<DIV>7、发生食品安全事故后未进行处置、报告的；</DIV>\r\n<DIV>8、其他法律法规规定应当立案查处的。</DIV>\r\n<DIV>第二十八条&nbsp; 巡查人员在巡查时发现可能引起社会、政府、媒体关注的严重质量问题时，要迅速向所在的县级局报告。对发现的不属于质监部门监管范围的事项，应做好相关记录，并及时报告所在的县级局。</DIV>\r\n<DIV>县级局应当将日常巡查情况记入该企业信用档案。日常巡查中获知的食品安全信息应依法通报同级相关监管部门。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第五章&nbsp; 日常巡查工作要求</DIV>\r\n<DIV>第二十九条&nbsp; 巡查人员应当遵守国家法律法规，不得滥用职权妨碍企业正常生产，不得索取或者收受企业财物，不得谋取其他利益。</DIV>\r\n<DIV>第三十条　巡查人员进入企业洁净区域进行巡查时，应遵守企业安全卫生防护措施等制度要求。</DIV>\r\n<DIV>第三十一条　县级局应按照市局《风险收集分析处置制度》的要求，按季度对本地区日常巡查中企业存在的主要问题及处置情况进行综合分析，形成分析报告上报市局；对发现的突发性严重产品质量问题或安全隐患要及时上报市局。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第六章&nbsp; 附&nbsp; 则</DIV>\r\n<DIV>第三十二条　县级局对食品添加剂生产企业日常巡查，应参照本规范执行。</DIV>\r\n<DIV>县级局对食品相关产品生产企业日常巡查，可结合本规范和市局重点产品生产企业日常巡查规范参照执行。</DIV>\r\n<DIV>第三十三条　本规范自二O一O年三月一日起施行薄西山。</DIV>\r\n<DIV>&nbsp;</DIV>', 'xc_food', null, null, '2010-02-27 15:14:00', '1', 'admin');
INSERT INTO `tbl_yginfo` VALUES ('8', '民生计量日常巡查工作规范', '<DIV align=center>第一章　总　则</DIV>\r\n<DIV>第一条　为加强全市质监系统民生计量监督管理，健全民生计量巡查工作制度，规范巡查行为，主动发现民生计量问题，进一步督促监管对象落实民生计量主体责任，确保辖区内民生计量准确可靠，根据《宁波市质监系统民生计量监管工作暂行规定》（以下简称《暂行规定》）的要求，制定本规范。</DIV>\r\n<DIV>第二条　民生计量巡查依据为《中华人民共和国计量法》等有关法律法规的规定。</DIV>\r\n<DIV>第三条　民生计量巡查以（强检管理系统）网上巡查为主，结合必须的现场巡查和专项执法检查进行实施。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第二章　组织领导</DIV>\r\n<DIV>第四条&nbsp; 市质监局计量处负责全市民生计量日常巡查工作的综合管理和监督检查。</DIV>\r\n<DIV>第五条&nbsp; 各县（市）、区质监局（分局）负责组织对本辖区内民生计量开展日常巡查工作。</DIV>\r\n<DIV>第六条&nbsp; 各县（市）、区质监局（分局）要根据市质监局的工作部署和日常巡查工作要求，整合科、队、站（所）的力量，明确具体的职责分工和工作机制，建立检查考评制度。</DIV>\r\n<DIV>第七条&nbsp; 市、县两级法定计量检定机构应积极为全市民生计量日常巡查工作提供技术支撑。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第三章　日常巡查要求</DIV>\r\n<DIV>第八条　各县（市）、区质监局（分局）应以保障民生健康、安全和经济利益为重点，根据以下要求，制订年度和季度民生计量巡查计划，并组织实施：</DIV>\r\n<DIV>（一）使用计量器具单位</DIV>\r\n<DIV>１、集贸市场</DIV>\r\n<DIV>　　以网上巡查为主，同时每年组织一次专项执法检查；逐步推行“四统一”的长效监管机制。</DIV>\r\n<DIV>２、医疗</DIV>\r\n<DIV>（1）眼镜店</DIV>\r\n<DIV>①通过强检管理系统进行网上巡查，对网上巡查中发现有问题的单位，组织现场巡查。</DIV>\r\n<DIV>②其余按20%的比例进行现场巡查。</DIV>\r\n<DIV>③结合工业产品生产许可证年审工作进行检查。</DIV>\r\n<DIV>（2）医疗卫生机构</DIV>\r\n<DIV>①对照现有的医疗卫生机构名单，通过对强检管理系统的网上巡查，对尚未登记在强检管理系统中的单位，以及对网上巡查中发现有问题的单位，组织现场巡查。</DIV>\r\n<DIV>②对镇（街道）医疗中心每半年现场巡查一次。在巡查镇（街道）医疗中心的同时，检查其所辖村、社区医疗服务站医疗计量相关台帐，并适当进行抽查。</DIV>\r\n<DIV>③其余按10%的比例进行现场巡查。</DIV>\r\n<DIV>３、交通（以机动车检验机构、出租车计价器为重点）</DIV>\r\n<DIV>①对机动车检验机构每年进行一次现场巡查。</DIV>\r\n<DIV>②会同当地公管部门，每年对出租车计价器抽查两次。４、民用四表</DIV>\r\n<DIV>对竣工验收后的新建住宅小区，进行抽查。</DIV>\r\n<DIV>５、加油站</DIV>\r\n<DIV>以网上巡查为主，同时每年组织一次专项执法检查。法定计量检定机构在强检时应协助做好巡查工作。</DIV>\r\n<DIV>６、液化气充装站</DIV>\r\n<DIV>每半年进行一次现场巡查。</DIV>\r\n<DIV>（二）制造计量器具单位</DIV>\r\n<DIV>以网上巡查为主，同时结合年度制造计量器具监督检查工作对制造计量器具单位进行检查。</DIV>\r\n<DIV>（三）销售计量器具单位</DIV>\r\n<DIV>每年进行一次现场巡查。</DIV>\r\n<DIV>（四）修理计量器具单位</DIV>\r\n<DIV>每年进行一次现场巡查。</DIV>\r\n<DIV>（五）生产、销售定量包装单位</DIV>\r\n<DIV>１、生产领域。以食品生产企业和液化气充装站为巡查对象，其中食品生产企业结合食品现场巡查工作实施；液化气充装站结合使用强检计量器巡查工作组织实施。</DIV>\r\n<DIV>２、销售领域。以大型超市为重点，每半年进行一次现场巡查。</DIV>\r\n<DIV>第九条　主动宣传计量法律法规及相关规定要求，督促辖区内监管对象主动承担民生计量主体责任。依法履行下列义务：</DIV>\r\n<DIV>（一）计量器具制造、修理单位和个人</DIV>\r\n<DIV>1、制造、修理纳入依法管理目录的计量器具应按规定领取《制造计量器具许可证》或《修理计量器具许可证》；</DIV>\r\n<DIV>2、应按标准组织生产，按规程开展检定；</DIV>\r\n<DIV>3、应建立健全企业内部质量管理制度和计量管理制度；</DIV>\r\n<DIV>4、出厂或经修理的计量产品应经检定合格，并具有产品合格证、许可证标志和编号；</DIV>\r\n<DIV>5、应确保产品或其包装上的标识真实且符合相关法律法规要求；</DIV>\r\n<DIV>6、依法承担其他法定的责任和义务。</DIV>\r\n<DIV>（二）计量器具销售单位和个人</DIV>\r\n<DIV>1、销售的计量器具应是：具有产品合格证、许可证标志和编号；</DIV>\r\n<DIV>2、进口列入《中华人民共和国进口计量器具型式审查目录》的计量器具应具有《中华人民共和国进口计量器具型式批准证书》，其他的应经省级以上计量行政部门检定合格；</DIV>\r\n<DIV>3、依法承担其他法定的责任和义务。</DIV>\r\n<DIV>（三）使用列入强检目录的民生计量器具开展经营管理活动的单位（包括集贸市场主办者）和个人</DIV>\r\n<DIV>1、应按规定建立计量器具台帐；</DIV>\r\n<DIV>2、应依法将本单位列入强检目录的民生计量器具报当地县（市）、区质监局（分局）备案，并向其指定的计量检定机构申请周期检定；当地不能检的，向市质监局指定的计量检定机构申请周期检定；</DIV>\r\n<DIV>3、不得使用未按照规定申请检定或检定不合格的计量器具；</DIV>\r\n<DIV>4、不得使用非法定计量单位的计量器具；</DIV>\r\n<DIV>5、依法承担其他法定的责任和义务。</DIV>\r\n<DIV>（四）生产、销售定量包装商品的单位和个人</DIV>\r\n<DIV>1、应配备与生产定量包装商品相适宜的定量包装计量检测设备，并经检定合格；</DIV>\r\n<DIV>2、生产、销售的定量包装商品标注和净含量应符合国家规定要求；</DIV>\r\n<DIV>3、依法承担其他法定的责任和义务。</DIV>\r\n<DIV>第十条　巡查重点内容：</DIV>\r\n<DIV>（一）对制造、修理计量器具的单位和个人</DIV>\r\n<DIV>1、检查获证情况，是否存在无证或超范围生产（修理）纳入依法管理范围的计量器具行为；</DIV>\r\n<DIV>2、检查原材料质量把关情况，是否存在生产（修理）过程中使用无证产品、国家明令禁止使用产品等违法行为；</DIV>\r\n<DIV>3、检查执行标准情况，是否存在无标生产、执行废标或未经备案的企业标准的违法行为；</DIV>\r\n<DIV>4、检查执行内部质量管理制度和计量管理制度情况，出厂的产品是否经检定合格，具有产品合格证、许可证标志和编号；</DIV>\r\n<DIV>5、检查待销（经修理合格）计量器具的标识标注情况，是否或存在假冒侵权和假冒许可证标志等违法行为。</DIV>\r\n<DIV>（二）对销售计量器具的单位和个人</DIV>\r\n<DIV>1、检查待销计量器具的标识标注情况，是否具有产品合格证、许可证标志和编号；</DIV>\r\n<DIV>2、检查待销进口计量器具的资质情况，进口列入《中华人民共和国进口计量器具型式审查目录》的计量器具是否具有《中华人民共和国进口计量器具型式批准证书》，其他的是否经省级以上计量行政部门检定合格。</DIV>\r\n<DIV>（三）对使用计量器具的单位和个人 </DIV>\r\n<DIV>1、检查计量器具的备案、检定情况，是否建立计量器具台帐，在用计量器具是否经强检合格并在有效期内；</DIV>\r\n<DIV>2、检查法定计量单位的使用情况，是否存在使用非法定计量单位和使用非法定计量单位的计量器具。</DIV>\r\n<DIV>（四）对生产、销售定量包装商品的单位和个人</DIV>\r\n<DIV>1、检查计量器具的配备及检定情况，是否配备与定量包装生产相适宜的定量包装计量检测设备，并经检定合格；</DIV>\r\n<DIV>2、检查定量包装商品的计量状况，生产、销售的定量包装商品标识是否符合国家规定要求，净含量的负偏差是否在国家允许范围内。</DIV>\r\n<DIV>第十一条　民生计量巡查应填写《民生计量日常巡查记录表》，详细记录巡查内容、督促整改等事项，经企业签字盖章确认后，存档备查；巡查信息应及时录入到巡查软件中。</DIV>\r\n<DIV>第十二条　各县（市）、区质监局（分局）要及时汇总分析民生计量巡查情况，建立巡查对象档案。针对发现的问题，落实具体的责任科（室）和人员，落实后续监管措施，督促被巡查对象限期整改。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第四章　问题处置</DIV>\r\n<DIV>第十三条　在网上巡查过程中发现以下问题的应进行现场巡查：</DIV>\r\n<DIV>（一）对制造计量器具的单位和个人</DIV>\r\n<DIV>1、计量标准考核证书、制造计量器具许可证超期未重新办理的；</DIV>\r\n<DIV>2、计量标准及主要配套设备超期未检。</DIV>\r\n<DIV>（二）对使用计量器具的单位和个人</DIV>\r\n<DIV>1、集贸市场未按规定设置公平秤，公平秤及经营户使用的计量器具超期未检；</DIV>\r\n<DIV>2、眼镜店在用的计量器具超期未检；</DIV>\r\n<DIV>3、医疗卫生机构未在强检管理系统中建档，以及医疗卫生机构在用的计量器具超期未检；</DIV>\r\n<DIV>4、加油站在用计量器具超期未检。</DIV>\r\n<DIV>第十四条　巡查人员在巡查中发现问题符合下列情形之一的，应责令企业限期改正：</DIV>\r\n<DIV>（一）对制造、修理计量器具的单位和个人：</DIV>\r\n<DIV>1、新增制造、修理项目的，未另行办理新增项目制造、修理计量器具许可，擅自制造、修理新增项目计量器具的；</DIV>\r\n<DIV>&nbsp;&nbsp;2、&nbsp;制造量程扩大或者准确度提高等超出原有许可范围的相同类型计量器具新产品，或者因有关技术标准和技术要求改变导致产品性能发生变更的计量器具的，未另行办理制造计量器具许可，擅自制造计量器具的；</DIV>\r\n<DIV>&nbsp;3、因制造或修理场地迁移、检验条件或技术工艺发生变化、兼并或重组等原因造成制造、修理条件改变的，未重新办理制造、修理计量器具许可，擅自制造、修理计量器具的；</DIV>\r\n<DIV>4、制造、修理计量器具的单位或个人更名、兼并、重组但未造成制造、修理条件改变的，应当办理许可证变更手续而未办理的；</DIV>\r\n<DIV>5、未标注或者未按规定标注制造、修理计量器具许可证标志和编号的；</DIV>\r\n<DIV>6、制造专供出口的计量器具未按规定向省质监局备案的。</DIV>\r\n<DIV>（二）对销售计量器具的单位和个人，待销计量器具的标识标注不符合规定的；</DIV>\r\n<DIV>（三）对使用计量器具的单位和个人 </DIV>\r\n<DIV>1、使用的计量器具未按规定备案、未建立计量器具台帐；</DIV>\r\n<DIV>2、使用非法定计量单位进行标价，以及使用非法定计量单位计量器具的；</DIV>\r\n<DIV>（四）对生产、销售定量包装商品的单位和个人</DIV>\r\n<DIV>生产、销售的定量包装商品，未正确标注、清晰地标注净含量或未标注净含量的；</DIV>\r\n<DIV>（五）其他法律法规规定应予以责令改正的情形。</DIV>\r\n<DIV>第十五条&nbsp; 巡查人员在巡查中发现问题符合下列情形之一的，应依法转立案查处：</DIV>\r\n<DIV>（一）对制造、修理计量器具的单位和个人</DIV>\r\n<DIV>1、未取得制造、修理计量器具许可，擅自从事计量器具制造、修理活动的；</DIV>\r\n<DIV>2、委托未取得与委托加工产品项目相应的制造计量器具许可的单位或个人加工计量器具的；</DIV>\r\n<DIV>被委托单位或个人未取得与委托加工产品项目相应的制造计量器具许可而接受委托、制造计量器具的；</DIV>\r\n<DIV>（二）对销售计量器具的单位和个人，销售的进口计量器具不符合规定的；</DIV>\r\n<DIV>（三）对使用计量器具的单位和个人 </DIV>\r\n<DIV>1、使用属于强制检定范围的计量器具，未按规定申请检定，以及经检定不合格继续使用的；</DIV>\r\n<DIV>2、使用不合格计量器具或者破坏计量器具准确度和伪造数据，以及使用以欺骗消费者为目的的计量器具的；</DIV>\r\n<DIV>（四）对生产、销售定量包装商品的单位和个人</DIV>\r\n<DIV>1、用于定量包装的计量器具，未按规定申请检定，以及经检定不合格继续使用的；</DIV>\r\n<DIV>2、生产、销售的定量包装商品，经检验，净含量不合格的；</DIV>\r\n<DIV>（五）其他法律法规规定应予以立案查处的情形。</DIV>\r\n<DIV>第十六条&nbsp; 巡查人员遇到符合下列情形之一的，可以对相关产品进行抽样检验（检定）：</DIV>\r\n<DIV>（一）生产、加工中使用未取得生产许可证或者未经强制性认证的原辅材料（产品）的；</DIV>\r\n<DIV>（二）执行已经公告废止的国家、行业、地方标准的；</DIV>\r\n<DIV>（三）出厂检定不符合执行检验规程规定的项目、方法和要求的。</DIV>\r\n<DIV align=center>&nbsp;</DIV>\r\n<DIV align=center>第五章　汇总分析</DIV>\r\n<DIV>第十七条　民生计量巡查结束后，要对被巡查对象存在的主要问题进行综合分析，形成分析报告，并按《宁波市质监系统质量安全风险信息收集、分析与处置工作制度》要求，每季度第一个月5日前将上一季度分析报告上报市局计量处。</DIV>\r\n<DIV>第十八条　民生计量巡查中，发现的行业性、区域性民生计量问题或具有潜规则的行业性民生计量安全隐患要及时上报市局，由市、县两级局视情开展民生计量产品质量专项监督抽查和民生计量专项执法检查。</DIV>\r\n<DIV align=left>&nbsp;</DIV>\r\n<DIV align=left>附件：<IMG src=\"/nbzjmanage/sysimage/file/doc.gif\" border=0><A href=\"/UploadFile/2011/8/9//20110809093101546.doc\" target=_blank>民生计量日常巡查记录表.doc</A></DIV>', 'xc_jl_new', null, null, '2010-03-01 15:47:15', '1', 'admin');
INSERT INTO `tbl_yginfo` VALUES ('9', '食品质量安全监管工作暂行规定', '<DIV align=center>第一章&nbsp; 总&nbsp; 则</DIV>\r\n<DIV>第一条&nbsp; 为切实加强食品生产环节质量安全监管，规范食品生产行为，保障人民群众身体健康，促进食品产业持续健康发展，根据《食品安全法》及其实施条例、《产品质量法》、《国务院关于加强食品等产品安全监督管理的特别规定》、《乳制品质量安全监督管理条例》等相关法律、法规，特制订本规定。</DIV>\r\n<DIV>第二条&nbsp; 质监部门负责食品生产环节质量安全监管工作。按照“明确职责分工、完善监管制度、落实责任到人、强化责任追究”的原则，明确质监部门的工作职责，建立完善监管工作制度，落实食品生产环节质量安全监管人员，督促企业落实质量安全主体责任并实施监管。</DIV>\r\n<DIV>第三条&nbsp; 本规定所指的食品生产企业是指依据《食品安全法》等法律规定取得食品生产许可的食品生产者。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第二章&nbsp; 职责分工</DIV>\r\n<DIV>第四条&nbsp; 巡查人员职责任务：</DIV>\r\n<DIV>(一)根据上级部门要求，认真落实食品质量安全“预告”和宣传教育工作；</DIV>\r\n<DIV>(二)严格按照《宁波市质监系统食品生产加工企业日常巡查工作规范》（见附件）规定内容开展日常巡查，并做好日常巡查记录;</DIV>\r\n<DIV>(三)严格按照《宁波市质监系统日常巡查发现问题处置规定》处理巡查中发现的问题;</DIV>\r\n<DIV>(四)对日常巡查中发现的产品质量违法行为，依法予以查处。</DIV>\r\n<DIV>第五条&nbsp; 县（市）、区质量技术监督局（分局）职责任务：</DIV>\r\n<DIV>（一）在地方政府的统一领导下，负责辖区内的食品生产环节质量安全监管工作，制定辖区食品生产年度安全监督管理计划，整合内部资源，依照法定权限和程序履行食品生产环节安全监管职责。</DIV>\r\n<DIV>（二）贯彻落实地方政府和宁波市局的工作部署，组织开展辖区食品生产环节质量安全日常巡查工作；及时协调处理巡查人员报告的有关问题，对违法行为依法进行查处，涉嫌犯罪的，依法移送公安机关；依据职责公布食品安全日常监督管理信息。</DIV>\r\n<DIV>（三）根据宁波市局部署，结合当地实际情况，组织开展辖区重点食品专项整治和食品生产环节年度普测工作，配合市局实施食品专项监督检（抽）查，建立辖区食品生产企业安全信用档案，对食品进行定期或不定期抽样检验，对有不良信用记录的企业增加抽样检验的频次，实施分类监管。</DIV>\r\n<DIV>（四）及时受理并答复、核实、处理接到的属于本部门职责的咨询、投诉、举报，对不属于本部门职责的，应当书面通知并移交有权处理的部门，并记录存档。</DIV>\r\n<DIV>（五）负责辖区内食品生产安全风险信息的收集、分析等工作，形成食品风险预分析报告，并定期上报宁波市局。</DIV>\r\n<DIV>（六）明确食品生产企业应当遵守的质量安全责任和法定义务，做好法律、法规的宣贯工作，确保辖区所有食品生产企业签署质量承诺书，督促企业全面履行主体责任。</DIV>\r\n<DIV>（七）在日常监督管理中发现食品安全事故，或者接到有关食品安全事故的举报，应立即向地方政府、地方卫生部门和市局通报，并配合做好食品安全事故调查处理；加强与地方卫生、农业、工商、食药监管部门沟通、配合；及时向发证机构、法定检验机构通报日常监管中发现的涉及行政许可、监督抽查工作质量的相关问题。</DIV>\r\n<DIV>（八）每年初向当地政府提交食品质量分析报告，汇报分析上年度食品质量形势，提出本年度工作计划。同时，根据工作实际，及时报告在履行监管职能中需要政府协调解决的以下问题：</DIV>\r\n<DIV>1、需要政府牵头组织整治的区域性、行业性食品质量安全问题；</DIV>\r\n<DIV>2、需要政府牵头处置的涉及食品生产环节的质量安全重大突发事件；</DIV>\r\n<DIV>3、根据食品质量安全监管工作需要，应配备的人、财、物等能力保障；</DIV>\r\n<DIV>4、将食品质量安全监管工作纳入对各级政府考核体系中。</DIV>\r\n<DIV>（九）健全食品生产安全监管工作制度，定期督查日常巡查人员的履职情况，建立规范的辖区食品生产安全监管工作档案。</DIV>\r\n<DIV>第六条&nbsp; 法定检验机构职责任务：</DIV>\r\n<DIV>（一）承担质监部门下达的监督检验任务，按规定时间报送检验结果，并以文件形式提供食品监督抽查质量分析报告；</DIV>\r\n<DIV>（二）提供质量安全检验检测信息，承担对重点食品的质量安全风险分析任务，及时上报工作中发现的行业性、区域性食品质量问题或具有潜规则的行业性质量安全隐患；</DIV>\r\n<DIV>（三）协助行政机关和专职执法机构实施监督检查和行政执法检查。</DIV>\r\n<DIV>第七条&nbsp; 市局稽查支队职责任务：</DIV>\r\n<DIV>（一）根据市局部署配合食品处开展食品专项执法检查；</DIV>\r\n<DIV>（二）承担市局交办的监督抽查不合格食品生产企业后处理任务；</DIV>\r\n<DIV>（三）提供涉及食品质量安全的执法办案信息，及时上报工作中发现的行业性、区域性产品质量问题或具有潜规则的行业性质量安全隐患，定期进行食品典型案例的分析工作，协助食品处开展行业潜规则的调查分析。</DIV>\r\n<DIV>第八条&nbsp; 宁波市质量技术监督局职责任务：</DIV>\r\n<DIV>（一）贯彻落实食品生产环节质量安全监管相关法律、法规、规章和宁波市政府、省局的工作部署，依照法定权限和程序履行食品生产环节安全监管职责。</DIV>\r\n<DIV>（二）在宁波市政府的统一领导下，制定全市的食品生产年度安全监督管理计划，提出年度重点监管和重点关注食品目录，制订实施全市地产食品普测计划，对重点食品的关键指标实施专项监督抽查，对高风险食品、上年度有不良记录企业实施从严抽查，组织开展重点关注食品的风险评估。</DIV>\r\n<DIV>（三）及时收集各类食品安全信息，并建立统一的管理制度。建立监督抽查公告制度，向社会公开食品生产企业违法行为和食品专项检查整治的情况。</DIV>\r\n<DIV>（四）组织食品生产环节质量安全突发事件的应急处置和善后处理工作。</DIV>\r\n<DIV>（五）根据食品质量监督抽查、风险分析结果，提出区域性、行业性食品质量问题警情建议，形成季度食品质量分析报告，部署落实列入质量预警食品的专项整冶。</DIV>\r\n<DIV>（六）健全完善系统食品质量安全监管工作制度，制订相关工作规范和考评办法，定期对县（市）、区局的日常巡查工作质量进行督查、考核。</DIV>\r\n<DIV>（七）每年初向宁波市政府提交食品质量安全分析报告，汇报分析上年度食品质量形势，提出本年度工作计划。同时，根据工作实际，及时报告在履行监管职能中需要政府协调解决的以下问题：</DIV>\r\n<DIV>1、需要政府牵头组织整治的区域性、行业性食品质量安全问题；</DIV>\r\n<DIV>2、需要政府牵头处置的涉及食品生产环节的质量安全重大突发事件；</DIV>\r\n<DIV>3、根据食品质量安全监管工作需要，应配备的人、财、物等能力保障；</DIV>\r\n<DIV>4、将食品质量安全监管工作纳入对各级政府考核体系中。</DIV>\r\n<DIV>（八）建议市、县两级政府落实与卫生、工商、农业等部门的职责分工、责任界线等相关监管关系，及时督促乡镇政府按要求履行监管职责，并加强对其工作考核。</DIV>\r\n<DIV>（九）与卫生、工商、农业等部门建立信息互通机制，及时交换有关信息。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV align=center>第三章&nbsp; 责任追究</DIV>\r\n<DIV>第九条&nbsp; 巡查人员未按本规定要求履职且出现下列情形之一的，视情给予批评教育、考核奖惩挂钩、组织处理：</DIV>\r\n<DIV>（一）未依法按职责、程序、要求开展日常巡查的，或日常巡查不到位的；</DIV>\r\n<DIV>（二）对日常巡查中发现的问题，未按规定进行处置的，或处置不到位的；</DIV>\r\n<DIV>（三）发现食品生产企业违法、违规行为未按规定报告的。 </DIV>\r\n<DIV>第十条&nbsp; 县（市）、区质量技术监督局（分局）未按本规定要求履职且出现下列情形之一的，视情给予批评教育、考核奖惩挂钩、组织处理：</DIV>\r\n<DIV>（一）对上级部门和当地政府关于食品质量安全监管工作的要求，不贯彻执行，不安排落实，造成监管缺失的；</DIV>\r\n<DIV>（二）辖区内发生负有直接监管责任的食品质量安全事件的； </DIV>\r\n<DIV>（三）发现重大质量问题未及时上报，导致被媒体曝光或上级部门通报的。</DIV>\r\n<DIV>第十一条&nbsp; 法定检验机构未按本规定要求履职且出现下列情形之一的，视情给予批评教育、考核奖惩挂钩、组织处理：</DIV>\r\n<DIV>（一）出现严重工作质量问题，受到省局、市局通报批评的； </DIV>\r\n<DIV>（二）未及时上报工作中发现的涉及区域性、行业性食品质量安全问题和行业潜规则信息的，不及时提供质量信息和质量分析报告的；</DIV>\r\n<DIV>（三）承办市局交办的工作任务，未按规定时间完成的。</DIV>\r\n<DIV>第十二条&nbsp; 市局稽查支队未按本规定要求履职且出现下列情形之一的，视情给予批评教育、考核奖惩挂钩、组织处理：</DIV>\r\n<DIV>（一）对群众涉及食品质量违法行为的投诉举报没有及时组织查处的；</DIV>\r\n<DIV>（二）未按法律法规的要求开展查处工作的；</DIV>\r\n<DIV>（三）承办市局交办的工作任务时，未按规定时间完成的。 </DIV>\r\n<DIV>第十三条&nbsp; 市局相关人员未按本规定要求履职且出现下列情形之一的，视情给予批评教育、考核奖惩挂钩、组织处理：</DIV>\r\n<DIV>（一）未按法律、法规以及省和市级政府的要求，明确食品质量安全监管工作职责，落实监管责任人和监管任务，导致监管工作职责不清或缺位，监管秩序混乱的； </DIV>\r\n<DIV>（二）对辖区内食品质量安全监管工作中存在的重大问题组织、协调不力的；</DIV>\r\n<DIV>（三）辖区内发生食品生产环节质量安全突发事件后应急处置、善后处理不力，造成事态扩大或产生严重后果的。</DIV>', 'xc_food', null, null, '2010-03-01 15:51:54', '1', 'admin');
