INSERT INTO `tbl_yginfo` VALUES ('16', '转发关于贯彻省委政法委《加强特定种类危险化学品安全管理工作协调会纪要》的意见', '<P><IMG src=\"/sysimage/file/xls.gif\" border=0><A href=\"/UploadFile/2010/4/23//20100423085512875.xls\" target=_blank>危险化学品获证企业名单2010-4-22.xls</A></P>\r\n<DIV align=center><B></B>&nbsp;</DIV>\r\n<DIV align=center><B></B>&nbsp;</DIV>\r\n<DIV align=right>甬质监稽[2010]7号</DIV>\r\n<DIV align=center><B>转发关于贯彻省委政法委</B></DIV>\r\n<DIV align=center><B>《加强特定种类危险化学品安全管理工作协调会纪要》的意见</B></DIV>\r\n<DIV>各县（市）、区质量技术监督局（分局）：</DIV>\r\n<DIV>现将《关于贯彻省委政法委〈加强特定种类危险化学品安全管理工作协调会纪要〉的意见》（甬世博安保办[2010]5号）转发给你们，并提出以下要求，请遵照执行。</DIV>\r\n<DIV>一、各县（市）、区质量技术监督局（分局）要将危险化学品获证生产企业纳入世博安全重点监管范围，加强日常巡查与专项监督检查，开展安全风险隐患的排查，建立应急具体方案，落实监管措施，减少、杜绝危险化学品获证生产企业可能引发的不安全因素，努力为上海世博会创造良好社会治安环境。</DIV>\r\n<DIV>二、督促危险化学品获证生产企业认真落实各种管理制度，持续保持发证条件，建立健全管理台账，加强对产品流向管理。</DIV>\r\n<DIV>附：危险化学品获证生产企业名单</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 二O一O年四月二十二日</DIV>', 'xc_jd_new', null, null, '2010-04-23 08:56:43', '1', 'admin');
INSERT INTO `tbl_yginfo` VALUES ('17', '近期巡查工作重点', '<DIV><FONT face=仿宋_GB2312 size=5>各县（市）、区质量技术监督局（分局）：</FONT></DIV>\r\n<DIV><FONT face=仿宋_GB2312 size=5>&nbsp;&nbsp;&nbsp; 现将国家认监委网上关于我市强制性玩具类产品（童车类、塑胶玩具类、金属玩具类、弹射玩具类、娃娃玩具类6种产品）获证企业情况下载后，发给你们，请各单位将这些企业作为巡查工作的重点，对四种情况（注销、撤销、暂停、有效）的企业，要仔细核对，对发现问题的企业，要严格按照《宁波市质监系统日常巡查发现问题处置规定》要求进行处理，并及时做好录入工作。</FONT></DIV>\r\n<DIV><IMG src=\"/sysimage/file/xls.gif\" border=0><A href=\"/UploadFile/2010/6/3//20100603050854972.xls\" target=_blank>副本3C玩具获证企业情况.xls</A></DIV>', 'xc_jd_new', null, null, '2010-06-03 17:05:46', '1', 'admin');
