INSERT INTO `tbl_yginfo` VALUES ('19', '食品添加剂生产企业执行标准巡查要求', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 根据质检总局质检办食监函[2010]420号文件，2009年6月1日以后新建的食品添加剂生产企业，其生产的食品添加剂质量、检验方法标准必须符合国家标准、行业标准的规定。企业申请无国家标准或行业标准的食品添加剂生产许可证，应当提供卫生部制定或者指定的生产工艺、产品质量标准和检验方法标准。', 'xc_food', null, null, '2010-06-12 15:58:23', '1', 'admin');
INSERT INTO `tbl_yginfo` VALUES ('20', '国家卫生部住房和城乡建设部质检总局关于加强饮用水水表监督管理的通知', '<IMG src=\"/sysimage/file/doc.gif\" border=0><A href=\"/UploadFile/2010/8/23//20100823093030454.doc\" target=_blank>转发国家卫生部住房和城乡建设部质检总局关于加强饮用水水表监督管理的通知质量函〔2010〕191号.doc</A><IMG src=\"/sysimage/file/zip.gif\" border=0><A href=\"/UploadFile/2010/8/23//20100823093348454.rar\" target=_blank>水表网.rar</A>', 'xc_jl_new', null, null, '2010-08-23 09:34:19', '1', '童晓瑾');
INSERT INTO `tbl_yginfo` VALUES ('21', '荧光灯巡查作业指导书', '荧光灯巡查作业指导书\r\n根据政协委员提案的意见建议，结合质监部门日常监管中发现的问题，请各位巡查人员在对荧光灯企业开展日常巡查时，重点检查企业有否用卤粉代替三基色粉生产的情况，如有发现，应责令企业改正，并抽样检验。\r\n（辨别三基色灯与卤粉灯的方法：1.三基色节能灯，外观较精致，塑料件通常采用耐高温的阻燃材料制成；而卤粉灯系伪劣产品，其外观粗糙，电路简单、元件劣次，更有甚者塑料件不阻燃，使用时危险性大。2.三基色节能灯，点亮几分钟后，才达到正常亮度、既明亮又柔和；而卤粉灯，一经通电，亮度基本达到峰值，亮度低、光色发青，显得苍白无力。3.一个简单的识别办法，将点亮的三基色灯，照在自己的手心上，手心则显得红润有血气；同样的卤粉灯照在手心上，则显得发青、无血色。当两只点亮的灯摆在一起比较，其区别显然而见。此外，在有条件的情况下，用验钞机的紫外线光照一下，可以看到三基色的灯显现蓝色，而卤粉则无反应）', 'xc_jd_new', null, null, '2011-04-19 17:22:57', '1', 'admin');
INSERT INTO `tbl_yginfo` VALUES ('24', '宁波市食品生产企业日常巡查记录表', '<IMG src=\"/nbzjmanage/sysimage/file/doc.gif\" border=0><A href=\"/UploadFile/2012/1/4//20120104031311718.doc\" target=_blank>宁波市食品生产企业日常巡查记录表（最新）.doc</A>', 'xc_food', null, null, '2012-01-04 15:13:24', '1', '李勇女');
INSERT INTO `wiki_content` VALUES ('1', '0', '首页', '<blockquote>\r\n<p align=\"left\">\r\n		宁波中软信息服务有限公司外围系统，2013年新框架架构，该框架环境主要由Weblogic 10+，java JDK1.6组成<strong><br />\r\n</strong> \r\n	</p>\r\n	<p>\r\n		<br />\r\n	</p>\r\n	<div>\r\n		明天到春节后的任务：<br />\r\n1.ajax&nbsp;upload的插件，要求和springmvc结合的例子<br />\r\n2.学习下<a href=\"https://code.google.com/p/rapid-framework/wiki/rapid_jsp_extends\" target=\"_blank\">https://code.google.com/p/rapid-framework/wiki/rapid_jsp_extends</a><br />\r\n试试看能不能用在我们的界面上<br />\r\n<br />\r\n		<div>\r\n			中软丶徐宁 &nbsp;2013年2月27日 15:01:21<br />\r\n<strong>你以后把后台sql文件也更新上去吧，</strong><br />\r\n<strong> 另外你前台框架设计完了的话，</strong><br />\r\n<strong> 开发下后台的一些基础功能。</strong><br />\r\n<strong> 设计个表结构，存一些全局的变量，如文件存储的基础路径</strong><br />\r\n<strong> 后台设计下附件上传后的表结构，表里有文件id和文件相对路径上传时间等。&nbsp;<br />\r\n后台sql文件，一般分两个，一个是建表脚本，一个是数据脚本。</strong>\r\n		</div>\r\n	</div>\r\n</blockquote>', '2013-02-16 18:11:56');
INSERT INTO `wiki_content` VALUES ('2', '6', 'ajaxupload使用说明', '<div style=\"text-align:center;\">\r\n<strong><span style=\"font-size:18px;\">ajaxupload插件使用的是fine uploader</span></strong> \r\n</div>\r\n<strong><span style=\"font-size:18px;\">&nbsp; &nbsp; &nbsp;</span></strong>该插件主要功能包括：<span style=\"color:#337FE5;\"><a href=\"/nbzjpt/ajaxUpload\" target=\"_blank\">示例页面</a></span><br />\r\n<ol>\r\n	<li>\r\n		<strong>简单模式</strong>：选择完文件后，不区分文件后缀、文件大小，直接默认上传到指定目录。\r\n	</li>\r\n	<li>\r\n		<strong>手动模式</strong>：选择完文件后，不区分文件后缀、文件大小，需要手动点击按钮，触发上传事件，方可上传。\r\n	</li>\r\n	<li>\r\n		<strong>上传后返回消息</strong>：可设置返回消息，并给出相应提示，消息是json数据<br />\r\n格式如：<span style=\"color:#DD1144;font-family:Menlo, Monaco, Consolas, \'Courier New\', monospace;background-color:#F7F7F9;\">{\"success\": false, \"reason\": \"不支持的文件类型\"}</span> \r\n	</li>\r\n	<li>\r\n		<strong>可配置允许的文件后缀，和文件大小</strong>，代码如下：\r\n<pre class=\"prettyprint lang-js\">var uploader4 = new qq.FineUploader({\r\n        element: $(\'#uploadWithVariousOptionsExample\')[0],\r\n        multiple: false,\r\n        request: {\r\n            endpoint: endpoint || \"\"\r\n        },\r\n        validation: {\r\n            allowedExtensions: [\'jpeg\', \'jpg\', \'txt\'],&nbsp;&nbsp;&nbsp;&nbsp;// 设置允许的文件后缀\r\n            sizeLimit: 50000&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;// 设置文件大小\r\n        },\r\n        text: {\r\n            uploadButton: \"Click Or Drop\"&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;// 设置上传按钮文本\r\n        },\r\n        callbacks: {\r\n            onError: errorHandler\r\n        }\r\n});</pre>\r\n	</li>\r\n	<li>\r\n		<strong>按钮区域可拖放文件</strong>：达到选择文件的目的直接上传\r\n	</li>\r\n</ol>', '2013-02-20 00:09:00');
INSERT INTO `wiki_content` VALUES ('3', '5', 'zTree的使用说明', '<p align=\"left\">\r\n<br />\r\n</p>\r\n<ol>\r\n	<li>\r\n		<strong>一次性加载数据</strong><a href=\"/nbzjpt/ztree/index\" target=\"_blank\"><span style=\"color:#337FE5;\"><br />\r\n</span></a><a href=\"/nbzjpt/ztree/index\" target=\"_blank\"><span style=\"color:#337FE5;\">示例页面</span></a> \r\n	</li>\r\n	<li>\r\n		<strong>异步加载数据：</strong>&nbsp;<strong>以目录为例，先读取第一层目录数据，点击某一目录后，再读取该目录下的子目录</strong><br />\r\n<a href=\"/nbzjpt/ztree/index_lazy\" target=\"_blank\"><span style=\"color:#337FE5;\">示例页面</span></a> \r\n	</li>\r\n</ol>', '2013-02-20 00:09:53');
INSERT INTO `wiki_content` VALUES ('4', '7', 'rapid页面继承组件', '<div style=\"text-align:center;\">\r\n<strong><span style=\"font-size:18px;line-height:2;\">页面继承组件选择使用rapid</span></strong><br />\r\n	<div style=\"text-align:left;\">\r\n		<span style=\"line-height:2;\">使用简单，只需在项目中引用一个jar</span><span style=\"line-height:2;\">包</span><span style=\"line-height:2;\">（rapid-framework-3.5.1.3.jar）即可使用。</span><br />\r\n<span style=\"line-height:2;\"> rapid在googlecode的主页</span><a href=\"https://code.google.com/p/rapid-framework/wiki/rapid_ant\"><span style=\"line-height:2;\">https://code.google.com/p/rapid-framework/wiki/rapid_ant</span><span style=\"line-height:2;\"><br />\r\n</span></a>开发步骤：<br />\r\n一：设计一个父页面：<a href=\"/nbzjpt/rapid/base\" target=\"_blank\">示例页面</a><br />\r\n&nbsp; &nbsp; 页面中头部添加&lt;%@ taglib uri=\"http://www.rapid-framework.org.cn/rapid\" prefix=\"rapid\" %&gt;<br />\r\n&nbsp; &nbsp; 设置子页面可以继承的部分（块）<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;<span>&lt;rapid:block name=\"head\"&gt;</span><br />\r\n<span></span><span>&nbsp;&nbsp;&nbsp;&nbsp;</span><span>&nbsp;&nbsp;&nbsp;&nbsp;</span><span>&lt;title&gt;&lt;/title&gt;</span><br />\r\n<span></span><span>&nbsp;&nbsp;&nbsp;&nbsp;</span><span>&nbsp;&nbsp;&nbsp;&nbsp;</span><span>&lt;meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" /&gt;</span><br />\r\n<span></span><span>&nbsp;&nbsp;&nbsp;</span><span>&nbsp;&nbsp;&nbsp;&nbsp;</span><span>&nbsp;</span><span>&lt;link rel=\"stylesheet\" href=\"${ctx}/resources/bootstrap/css/bootstrap.min.css\" type=\"text/css\"&gt;</span><br />\r\n<span>&nbsp;&nbsp;&nbsp;&nbsp;</span><span>&lt;/rapid:block&gt;</span><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;rapid:block name=\"content\"&gt;&lt;/rapid:block&gt;<br />\r\n	</div>\r\n</div>\r\n<div style=\"text-align:center;\">\r\n	<div style=\"text-align:left;\">\r\n		二：添加子页面，继承父页面，<a href=\"/nbzjpt/rapid/child\" target=\"_blank\">示例页面</a><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;\r\n<pre class=\"prettyprint lang-java\">&lt;%@ taglib uri=\"http://www.rapid-framework.org.cn/rapid\" prefix=\"rapid\" %&gt;\r\n&lt;rapid:override name=\"content\"&gt;\r\n&lt;div&gt;\r\n	&lt;label class=\"label label-info\"&gt;这是子页面内容&lt;/label&gt;\r\n	&lt;button class=\"btn\"&gt;按钮&lt;/button&gt;\r\n&lt;/div&gt;\r\n&lt;/rapid:override&gt;\r\n&lt;%@ include file=\"base.jsp\" %&gt;</pre>\r\n&nbsp;子页面只需要使用override来覆盖父页面的内容就可以实现继承。\r\n	</div>\r\n</div>', '2013-02-20 01:15:19');
